in and password, %1$s do not share it%2$s!";s:10:"LoadedAPIs";s:14:"Loaded %s APIs";s:15:"MoreInformation";s:117:"More info about the Matomo APIs available in %1$sIntroduction to Matomo API%2$s and the %3$sMatomo API Reference%4$s.";s:17:"PluginDescription";s:178:"All the data in Matomo is available through simple APIs. This plugin is the web-service entry point, that you can call to get your web analytics data in XML, JSON, PHP, CSV, etc.";s:21:"ReportingApiReference";s:23:"Reporting API Reference";s:14:"TopLinkTooltip";s:87:"Access your Web Analytics data programmatically through a simple API in JSON, XML, etc.";s:18:"UserAuthentication";s:19:"User authentication";s:14:"UsingTokenAuth";s:164:"If you want to %1$srequest data within a script, a crontab, etc.%2$s you need to add the \'%3$s\' URL parameter to the API calls for URLs that require authentication.";s:8:"Glossary";s:8:"Glossary";s:30:"MainMetricsReportDocumentation";s:94:"This report gives an overview of the most important metrics across all categories and plugins.";s:28:"LearnAboutCommonlyUsedTerms2";s:69:"Learn about commonly used terms to make the most of Matomo analytics.";s:19:"EvolutionMetricName";s:12:"%s Evolution";}s:7:"Actions";a:96:{s:24:"AvgGenerationTimeTooltip";s:55:"Average based on %1$s hit(s) %2$s between %3$s and %4$s";s:16:"ColumnClickedURL";s:15:"Clicked Outlink";s:17:"ColumnClickedURLs";s:16:"Clicked Outlinks";s:15:"ColumnActionURL";s:10:"Action URL";s:12:"ColumnClicks";s:6:"Clicks";s:25:"ColumnClicksDocumentation";s:42:"The number of times this link was clicked.";s:17:"ColumnDownloadURL";s:12:"Download URL";s:18:"ColumnDownloadURLs";s:13:"Download URLs";s:20:"ColumnEntryPageTitle";s:16:"Entry Page title";s:18:"ColumnEntryPageURL";s:14:"Entry Page URL";s:19:"ColumnEntryPageURLs";s:15:"Entry Page URLs";s:19:"ColumnExitPageTitle";s:15:"Exit Page Title";s:17:"ColumnExitPageURL";s:13:"Exit Page URL";s:18:"ColumnExitPageURLs";s:14:"Exit Page URLs";s:21:"ColumnNoResultKeyword";s:29:"Keyword with No Search Result";s:14:"ColumnPageName";s:9:"Page Name";s:20:"ColumnPagesPerSearch";s:20:"Search Results pages";s:33:"ColumnPagesPerSearchDocumentation";s:162:"Visitors will search on your website, and sometimes click "next" to view more results. This is the average number of search results pages viewed for this keyword.";s:13:"ColumnPageURL";s:8:"Page URL";s:20:"ColumnSearchCategory";s:15:"Search Category";s:14:"ColumnSearches";s:8:"Searches";s:27:"ColumnSearchesDocumentation";s:84:"The number of visits that searched for this keyword on your website\'s search engine.";s:17:"ColumnSearchExits";s:15:"%% Search Exits";s:30:"ColumnSearchExitsDocumentation";s:107:"The percentage of visits that left the website after searching for this Keyword on your Site Search engine.";s:24:"ColumnSearchResultsCount";s:20:"Search Results Count";s:24:"ColumnSiteSearchKeywords";s:15:"Unique Keywords";s:18:"ColumnUniqueClicks";s:13:"Unique Clicks";s:31:"ColumnUniqueClicksDocumentation";s:136:"The number of visits that involved a click on this link. If a link was clicked multiple times during one visit, it is only counted once.";s:21:"ColumnUniqueDownloads";s:16:"Unique Downloads";s:20:"ColumnUniqueOutlinks";s:15:"Unique Outlinks";s:16:"ColumnIdPageview";s:11:"Pageview ID";s:25:"ColumnInteractionPosition";s:20:"Interaction Position";s:22:"ColumnPageViewPosition";s:17:"Pageview Position";s:14:"ActionsInVisit";s:16:"Actions In Visit";s:28:"DownloadsReportDocumentation";s:204:"In this report, you can see which files your visitors have downloaded. %s What Matomo counts as a download is the click on a download link. Whether the download was completed or not isn\'t known to Matomo.";s:29:"EntryPagesReportDocumentation";s:223:"This report contains information about the entry pages that were used during the specified period. An entry page is the first page that a user views during their visit. %s The entry URLs are displayed as a folder structure.";s:15:"EntryPageTitles";s:17:"Entry page titles";s:34:"EntryPageTitlesReportDocumentation";s:108:"This report contains information about the titles of entry pages that were used during the specified period.";s:28:"ExitPagesReportDocumentation";s:218:"This report contains information about the exit pages that occurred during the specified period. An exit page is the last page that a user views during their visit. %s The exit URLs are displayed as a folder structure.";s:14:"ExitPageTitles";s:16:"Exit page titles";s:33:"ExitPageTitlesReportDocumentation";s:106:"This report contains information about the titles of exit pages that occurred during the specified period.";s:30:"MainMetricsReportDocumentation";s:94:"This report provides a very basic overview of what actions your visitors take on your website.";s:9:"OneSearch";s:8:"1 search";s:20:"OutlinkDocumentation";s:87:"An outlink is a link that leads the visitor away from your website (to another domain).";s:27:"OutlinksReportDocumentation";s:89:"This report shows a hierarchical list of outlink URLs that were clicked by your visitors.";s:24:"PagesReportDocumentation";s:164:"This report contains information about the page URLs that have been visited. %s The table is organized hierarchically, the URLs are displayed as a folder structure.";s:29:"PageTitlesReportDocumentation";s:174:"This report contains information about the titles of the pages that have been visited. %1$s The page title is the HTML %2$s Tag that most browsers show in their window title.";s:8:"PageUrls";s:9:"Page URLs";s:18:"PageViewsByVisitor";s:70:"Number of times this page was viewed by this visitor across all visits";s:17:"PluginDescription";s:167:"Reports about the page views and page titles. Lets you measure your internal website\'s search engine. Automatically tracks clicks on external links and file downloads.";s:14:"RevisitedPages";s:27:"Pages viewed more than once";s:21:"SiteSearchCategories1";s:96:"This report lists the Categories that visitors selected when they made a Search on your website.";s:21:"SiteSearchCategories2";s:153:"For example, Ecommerce websites typically have a "Category" selector so that visitors can restrict their searches to all products in a specific Category.";s:27:"SiteSearchFollowingPagesDoc";s:281:"When visitors search on your website, they are looking for a particular page, content, product, or service. This report lists the pages that were clicked the most after an internal search. In other words, the list of pages the most searched for by visitors already on your website.";s:15:"SiteSearchIntro";s:307:"Tracking searches that visitors make on your website is a very effective way to learn more about what your audience is looking for, it can help find ideas for new content, new Ecommerce products that potential customers might be searching for, and generally improve the visitors\' experience on your website.";s:18:"SiteSearchCategory";s:22:"Category (Site Search)";s:20:"SiteSearchCategories";s:24:"Categories (Site Search)";s:17:"SiteSearchKeyword";s:21:"Keyword (Site Search)";s:18:"SiteSearchKeywords";s:22:"Keywords (Site Search)";s:22:"SiteSearchKeywordCount";s:27:"Keyword count (Site Search)";s:23:"SiteSearchKeywordCounts";s:28:"Keyword counts (Site Search)";s:31:"SiteSearchKeywordsDocumentation";s:96:"This report lists the Search Keywords that visitors searched for on your internal Search Engine.";s:39:"SiteSearchKeywordsNoResultDocumentation";s:209:"This report lists the Search Keywords that did not return any Search result: maybe the search engine algorithm can be improved, or maybe your visitors are looking for content that is not (yet) on your website?";s:17:"SubmenuPagesEntry";s:11:"Entry pages";s:16:"SubmenuPagesExit";s:10:"Exit pages";s:17:"SubmenuPageTitles";s:11:"Page titles";s:17:"SubmenuSitesearch";s:11:"Site Search";s:21:"WidgetEntryPageTitles";s:17:"Entry Page Titles";s:20:"WidgetExitPageTitles";s:16:"Exit Page Titles";s:16:"WidgetPagesEntry";s:11:"Entry Pages";s:15:"WidgetPagesExit";s:10:"Exit Pages";s:16:"WidgetPageTitles";s:11:"Page Titles";s:31:"WidgetPageTitlesFollowingSearch";s:35:"Page Titles Following a Site Search";s:29:"WidgetPageUrlsFollowingSearch";s:29:"Pages Following a Site Search";s:22:"WidgetSearchCategories";s:17:"Search Categories";s:20:"WidgetSearchKeywords";s:20:"Site Search Keywords";s:28:"WidgetSearchNoResultKeywords";s:31:"Search Keywords with No Results";s:10:"ActionType";s:11:"Action Type";s:11:"ActionTypes";s:12:"Action Types";s:9:"Behaviour";s:9:"Behaviour";s:26:"TimeSpentInReferringAction";s:30:"Time Spent in Referring Action";s:21:"PagesSubcategoryHelp1";s:76:"This report contains information about the page URLs that have been visited.";s:21:"PagesSubcategoryHelp2";s:84:"The table is organized hierarchically, the URLs are displayed as a folder structure.";s:21:"PagesSubcategoryHelp3";s:53:"Use the plus and minus icons on the left to navigate.";s:26:"EntryPagesSubcategoryHelp1";s:168:"This report contains information about the entry pages that were used during the specified period. An entry page is the first page that a user views during their visit.";s:26:"EntryPagesSubcategoryHelp2";s:51:"The entry URLs are displayed as a folder structure.";s:25:"ExitPagesSubcategoryHelp1";s:164:"This report contains information about the exit pages that occurred during the specified period. An exit page is the last page that a user views during their visit.";s:25:"ExitPagesSubcategoryHelp2";s:50:"The exit URLs are displayed as a folder structure.";s:26:"PageTitlesSubcategoryHelp1";s:86:"This report contains information about the titles of the pages that have been visited.";s:26:"PageTitlesSubcategoryHelp2";s:99:"The page title is the HTML &amp;lt;title&amp;gt; Tag that most browsers show in their window title.";s:26:"SiteSearchSubcategoryHelp1";s:212:"The Site Search section shows which keywords visitors use when searching your website. It also displays which pages users view after performing a search and which on-site search keywords return no results at all.";s:26:"SiteSearchSubcategoryHelp2";s:151:"These reports can give you ideas about missing content on your site, insight into what your visitors are looking for but can’t find easily, and more.";s:26:"SiteSearchSubcategoryHelp3";s:36:"Learn more in the Site Search guide.";s:24:"OutlinksSubcategoryHelp1";s:177:"This report shows a hierarchical list of outlink URLs that were clicked by your visitors. An outlink is a link that leads the visitor away from your website (to another domain).";s:25:"DownloadsSubcategoryHelp1";s:70:"In this report, you can see which files your visitors have downloaded.";s:25:"DownloadsSubcategoryHelp2";s:130:"What Matomo counts as a download is the click on a download link. Whether the download was completed or not isn\'t known to Matomo.";}s:11:"Annotations";a:18:{s:17:"AddAnnotationsFor";s:25:"Add annotations for %s...";s:16:"AnnotationOnDate";s:24:"Annotation on %1$s: %2$s";s:11:"Annotations";s:11:"Annotations";s:13:"ClickToDelete";s:32:"Click to delete this annotation.";s:11:"ClickToEdit";s:30:"Click to edit this annotation.";s:16:"ClickToEditOrAdd";s:38:"Click to edit or add a new annotation.";s:19:"ClickToStarOrUnstar";s:40:"Click to star or unstar this annotation.";s:19:"CreateNewAnnotation";s:26:"Create a new annotation...";s:19:"EnterAnnotationText";s:18:"Enter your note...";s:18:"HideAnnotationsFor";s:26:"Hide annotations for %s...";s:8:"IconDesc";s:31:"View notes for this date range.";s:17:"IconDescHideNotes";s:31:"Hide notes for this date range.";s:15:"InlineQuickHelp";s:170:"You can create annotations to mark special events (like a new blog post, or website redesign), to save your data analyses or to save anything else you think is important.";s:15:"LoginToAnnotate";s:30:"Login to create an annotation.";s:13:"NoAnnotations";s:45:"There are no annotations for this date range.";s:17:"PluginDescription";s:265:"Allows you to attach notes to different days to mark changes made to your website, save analyses you make regarding your data and share your thoughts with your colleagues. By annotating your data, you will make sure you remember why your data looks the way it does.";s:21:"ViewAndAddAnnotations";s:34:"View and add annotations for %s...";s:23:"YouCannotModifyThisNote";s:109:"You cannot modify this annotation, because you did not create it, nor do you have admin access for this site.";}s:8:"Contents";a:20:{s:17:"PluginDescription";s:149:"Content and banner tracking lets you measure the performance (views, clicks, CTR) of any piece of content on your pages (Banner ad, image, any item).";s:11:"Impressions";s:11:"Impressions";s:17:"ContentImpression";s:18:"Content Impression";s:18:"ContentInteraction";s:19:"Content Interaction";s:19:"ContentInteractions";s:20:"Content Interactions";s:15:"InteractionRate";s:16:"Interaction Rate";s:11:"ContentName";s:12:"Content Name";s:30:"ContentNameReportDocumentation";s:84:"This report shows the names of the content your visitors viewed and interacted with.";s:12:"ContentNames";s:13:"Content Names";s:12:"ContentPiece";s:13:"Content Piece";s:31:"ContentPieceReportDocumentation";s:81:"This report shows the pieces of content your visitors viewed and interacted with.";s:13:"ContentPieces";s:14:"Content Pieces";s:13:"ContentTarget";s:14:"Content Target";s:14:"ContentTargets";s:15:"Content Targets";s:8:"Contents";s:8:"Contents";s:31:"InteractionsMetricDocumentation";s:90:"The number of times a content block was interacted with (eg, a \'click\' on a banner or ad).";s:30:"ImpressionsMetricDocumentation";s:88:"The number of times a content block, such as a banner or an ad, was displayed on a page.";s:34:"InteractionRateMetricDocumentation";s:49:"The ratio of content impressions to interactions.";s:24:"ContentsSubcategoryHelp1";s:233:"Content tracking helps you determine the popularity of specific pieces of content on any page of your website or app. This section reports the number of impressions and interactions the various pieces of content on your site receive.";s:24:"ContentsSubcategoryHelp2";s:41:"Learn more in the Content Tracking guide.";}s:13:"CoreAdminHome";a:177:{s:17:"AddNewTrustedHost";s:22:"Add a new trusted host";s:14:"Administration";s:14:"Administration";s:17:"ArchivingSettings";s:18:"Archiving settings";s:16:"BrandingSettings";s:17:"Branding settings";s:10:"BruteForce";s:11:"Brute Force";s:12:"CheckToOptIn";s:25:"Check this box to opt-in.";s:16:"ClickHereToOptIn";s:21:"Click here to opt in.";s:17:"ClickHereToOptOut";s:22:"Click here to opt out.";s:32:"ConfirmDeleteAllTrackingFailures";s:54:"Are you sure you want to delete all tracking failures?";s:32:"ConfirmDeleteThisTrackingFailure";s:54:"Are you sure you want to delete this tracking failure?";s:4:"Cors";s:4:"Cors";s:11:"CorsDomains";s:44:"Cross-Origin Resource Sharing (CORS) domains";s:15:"CorsDomainsHelp";s:154:"You can define domains or subdomains like http://example.com or http://stats.example.com. Or to allow cross domain requests for all domains simply add a *";s:22:"CustomLogoFeedbackInfo";s:183:"If you customize the Matomo logo, you might also be interested to hide the %1$s link in the top menu. To do so, you can disable the Feedback plugin in the %2$sManage Plugins%3$s page.";s:18:"CustomLogoHelpText";s:98:"You can customize the Matomo logo which will be displayed in the user interface and email reports.";s:17:"DeleteAllFailures";s:19:"Delete all failures";s:18:"DevelopmentProcess";s:141:"While our development process includes thousands of automated tests, Beta Testers play a key role in achieving the "No bug policy" in Matomo.";s:19:"EmailServerSettings";s:21:"Email server settings";s:29:"ErrorEmailFromAddressNotValid";s:34:"The SMTP from address is not valid";s:13:"FaviconUpload";s:26:"Select a Favicon to upload";s:18:"FileUploadDisabled";s:137:"Uploading files is not enabled in your PHP configuration. To upload your custom logo please set %s in php.ini and restart your webserver.";s:18:"ForBetaTestersOnly";s:21:"For beta testers only";s:15:"HttpTrackingApi";s:17:"HTTP Tracking API";s:26:"HttpTrackingApiDescription";s:233:"The %1$sHTTP Tracking API%2$s allows you to track anything. This may be useful if you are using a programming language for which no SDK exists yet. It may also be useful when you want to track devices or application in a special way.";s:32:"SinglePageApplicationDescription";s:120:"If you are tracking a single-page application (SPA) or progressive web application (PWA), please see %1$sthis guide%2$s.";s:13:"ImageTracking";s:14:"Image Tracking";s:19:"ImageTrackingIntro1";s:128:"When a visitor has disabled JavaScript, or when JavaScript cannot be used, you can use an image tracking link to track visitors.";s:19:"ImageTrackingIntro2";s:164:"Generate the link below and copy-paste the generated HTML in the page. If you\'re using this as a fallback for JavaScript tracking, you can surround it in %1$s tags.";s:19:"ImageTrackingIntro3";s:114:"For the whole list of options you can use with an image tracking link, see the %1$sTracking API Documentation%2$s.";s:17:"ImageTrackingLink";s:19:"Image Tracking Link";s:25:"ImportFromGoogleAnalytics";s:28:"Import from Google Analytics";s:36:"ImportFromGoogleAnalyticsDescription";s:152:"If you have a Google Analytics property and are switching to Matomo, you can import your existing data using the %1$sGoogleAnalyticsImporter%2$s plugin.";s:19:"ImportingServerLogs";s:21:"Importing Server Logs";s:23:"ImportingServerLogsDesc";s:187:"An alternative to tracking visitors through the browser (either via JavaScript or an image link) is to continuously import server logs. Learn more about %1$sServer Log File Analytics%2$s.";s:21:"InvalidPluginsWarning";s:81:"The following plugins are not compatible with %1$s and could not be loaded: %2$s.";s:29:"InvalidPluginsYouCanUninstall";s:77:"You can update or uninstall these plugins on the %1$sManage Plugins%2$s page.";s:16:"JSTrackingIntro1";s:237:"You can track visitors to your website in many different ways. The recommended way to do it is through JavaScript. To use this method you must make sure every webpage of your website has some JavaScript code, which you can generate here.";s:16:"JSTrackingIntro2";s:126:"Once you have the JavaScript tracking code for your website, copy and paste it to all the pages you want to track with Matomo.";s:17:"JSTrackingIntro3a";s:158:"In most websites, blogs, CMS, etc. you can use a pre-made plugin to do the technical work for you. (See our %1$slist of plugins used to integrate Matomo%2$s.)";s:17:"JSTrackingIntro3b";s:198:"If no plugin exists you can edit your website templates and add the JavaScript tracking code to the &lt;/head&gt; tag which is often defined in a \'header.php\', \'header.tpl\' or similar template file.";s:16:"JSTrackingIntro4";s:101:"If you don\'t want to use JavaScript to track visitors, %1$sgenerate an image tracking link below%2$s.";s:16:"JSTrackingIntro5";s:257:"If you want to do more than track page views, please check out the %1$sMatomo Javascript Tracking documentation%2$s for the list of available functions. Using these functions you can track goals, custom variables, ecommerce orders, abandoned carts and more.";s:27:"JSTracking_CampaignKwdParam";s:26:"Campaign Keyword parameter";s:28:"JSTracking_CampaignNameParam";s:23:"Campaign Name parameter";s:36:"JSTracking_CodeNoteBeforeClosingHead";s:118:"Make sure this code is on every page of your website. We recommend pasting it immediately before the closing %1$s tag.";s:41:"JSTracking_CodeNoteBeforeClosingHeadEmail";s:151:"Make sure this code is embedded within a script element on every page of your website. We recommend pasting it immediately before the closing head tag.";s:33:"JSTracking_ConsentManagerDetected";s:117:"%1$s consent manager was detected on your site. To learn about configuring Matomo to work with %1$s please visit %2$s";s:34:"JSTracking_ConsentManagerConnected";s:58:"%1$s appears to already be configured to work with Matomo.";s:34:"JSTracking_ConsentManagerEmailNote";s:70:"Or you could directly embed the tracking code in your website instead:";s:22:"JSTracking_CrossDomain";s:460:"By default, the visitor ID that identifies a unique visitor is stored in the browser\'s first party cookies which can only be accessed by pages on the same domain. Enabling cross domain linking lets you track all the actions and pageviews of a specific visitor into the same visit even when they view pages on several domains. Whenever a user clicks on a link to one of your website\'s alias URLs, it will append a URL parameter pk_vid forwarding the Visitor ID.";s:43:"JSTracking_CrossDomain_NeedsMultipleDomains";s:102:"Note: To use cross domain linking, you must specify more than one domain name (URLs) for your website.";s:35:"JSTracking_CustomCampaignQueryParam";s:66:"Use custom query parameter names for the campaign name and keyword";s:39:"JSTracking_CustomCampaignQueryParamDesc";s:75:"Note: %1$sMatomo will automatically detect Google Analytics parameters.%2$s";s:25:"JSTracking_DisableCookies";s:28:"Disable all tracking cookies";s:29:"JSTracking_DisableCookiesDesc";s:112:"Disables all first party cookies. Existing Matomo cookies for this website will be deleted on the next pageview.";s:35:"JSTracking_EnableCrossDomainLinking";s:28:"Enables cross domain linking";s:27:"JSTracking_EnableDoNotTrack";s:39:"Enable client side DoNotTrack detection";s:31:"JSTracking_EnableDoNotTrackDesc";s:76:"So tracking requests will not be sent if visitors do not wish to be tracked.";s:42:"JSTracking_EnableDoNotTrack_AlreadyEnabled";s:90:"Note: Server side DoNotTrack support has been enabled, so this option will have no effect.";s:18:"JSTracking_EndNote";s:93:"Note: You can generate a customized tracking code in the %1$sTracking Code%2$s admin section.";s:34:"JSTracking_GroupPageTitlesByDomain";s:55:"Prepend the site domain to the page title when tracking";s:39:"JSTracking_GroupPageTitlesByDomainDesc1";s:163:"So if someone visits the \'About\' page on blog.%1$s it will be recorded as \'blog / About\'. This is the easiest way to get an overview of your traffic by sub-domain.";s:23:"JSTracking_MergeAliases";s:60:"In the "Outlinks" report, hide clicks to known alias URLs of";s:27:"JSTracking_MergeAliasesDesc";s:75:"So clicks on links to Alias URLs (eg. %s) will not be counted as "Outlink".";s:26:"JSTracking_MergeSubdomains";s:39:"Track visitors across all subdomains of";s:30:"JSTracking_MergeSubdomainsDesc";s:81:"So if one visitor visits %1$s and %2$s, they will be counted as a unique visitor.";s:25:"JSTracking_PageCustomVars";s:42:"Track a custom variable for each page view";s:29:"JSTracking_PageCustomVarsDesc";s:68:"For example, with variable name "Category" and value "White Papers".";s:24:"JSTracking_TrackNoScript";s:36:"Track users with JavaScript disabled";s:28:"JSTracking_VisitorCustomVars";s:39:"Track custom variables for this visitor";s:32:"JSTracking_VisitorCustomVarsDesc";s:60:"For example, with variable name "Type" and value "Customer".";s:18:"JavaScriptTracking";s:19:"JavaScript Tracking";s:27:"JsTrackingCodeMissingEmail1";s:159:"A few days ago you added the website \'%s\' to your Matomo Analytics. We just checked and your Matomo doesn\'t seem to have any recorded traffic for this website.";s:27:"JsTrackingCodeMissingEmail2";s:191:"To begin tracking data and getting insights into your users, you\'ll need to set up tracking in your website or mobile app. For websites simply embed the tracking code right before the %s tag.";s:27:"JsTrackingCodeMissingEmail3";s:126:"To find and customize your tracking code, %1$sclick here%2$s (or have a look at the %3$sJavaScript Tracking Client guide%4$s).";s:9:"LearnMore";s:10:"Learn more";s:27:"LogoNotWriteableInstruction";s:172:"To use your custom logo instead of the default Matomo logo, give write permission to this directory: %1$s Matomo needs write access for your logos stored in the files %2$s.";s:10:"LogoUpload";s:23:"Select a Logo to upload";s:16:"LogoUploadFailed";s:85:"The uploa