on shows the operating systems, browsers and plugins that your visitors are using to access the site so that you can optimise your site to ensure it is fully compatible with the most popular configurations.";s:26:"EngagementSubcategoryHelp1";s:312:"The Engagement section provides reports that help to quantify how many new and returning visitors you get. You can also review reports that break down the average time and number of pages per visit, as well as the number of times a visitor has been to your site and the most common number of days between visits.";s:26:"EngagementSubcategoryHelp2";s:109:"This can help you to optimise for frequency and high-interaction visits in addition to maximising your reach.";s:20:"PeriodHasOnlyRawData";s:207:"It looks like reports for this period have not been processed yet. Do you want to see what\'s happening now? Check out the %1$sVisits log%2$s or choose a different date period until the reports are generated.";s:9:"StartDate";s:10:"Start Date";s:7:"EndDate";s:8:"End Date";}s:16:"CorePluginsAdmin";a:86:{s:15:"ActionUninstall";s:9:"Uninstall";s:8:"Activate";s:8:"Activate";s:9:"Activated";s:9:"Activated";s:6:"Active";s:6:"Active";s:8:"Activity";s:8:"Activity";s:26:"AlwaysActivatedPluginsList";s:69:"The following plugins are always activated and cannot be disabled: %s";s:14:"AuthorHomepage";s:15:"Author Homepage";s:9:"Changelog";s:9:"Changelog";s:22:"ChangeSettingsPossible";s:48:"You can change %1$ssettings%2$s for this plugin.";s:17:"CorePluginTooltip";s:68:"Core plugins have no version since they are distributed with Matomo.";s:10:"Deactivate";s:10:"Deactivate";s:24:"DoMoreContactPiwikAdmins";s:84:"To install a new plugin or a new theme, please get in touch with your Matomo admins.";s:24:"ChangeLookByManageThemes";s:67:"You can change the appearance of Matomo by %1$sManaging Themes%2$s.";s:7:"History";s:7:"History";s:8:"Inactive";s:8:"Inactive";s:16:"InstalledPlugins";s:17:"Installed plugins";s:15:"InstalledThemes";s:16:"Installed themes";s:29:"InfoPluginUpdateIsRecommended";s:64:"Update your plugins now to benefit from the latest improvements.";s:33:"InfoThemeIsUsedByOtherUsersAsWell";s:83:"Note: the other %1$s users registered in this Matomo are also using the theme %2$s.";s:28:"InfoThemeUpdateIsRecommended";s:47:"Update your themes to enjoy the latest version.";s:17:"InstallNewPlugins";s:19:"Install new plugins";s:16:"InstallNewThemes";s:18:"Install new themes";s:15:"LicenseHomepage";s:16:"License Homepage";s:14:"LikeThisPlugin";s:17:"Like this plugin?";s:16:"ConsiderDonating";s:17:"Consider donating";s:26:"CommunityContributedPlugin";s:64:"This is a community contributed plugin, brought to you for free.";s:25:"ConsiderDonatingCreatorOf";s:45:"Please consider donating to the creator of %s";s:18:"PluginsExtendPiwik";s:54:"Plugins extend and expand the functionality of Matomo.";s:39:"OncePluginIsInstalledYouMayActivateHere";s:70:"Once a plugin is installed, you may activate it or deactivate it here.";s:12:"MenuPlatform";s:8:"Platform";s:25:"MissingRequirementsNotice";s:66:"Please update %1$s %2$s to a newer version, %1$s %3$s is required.";s:38:"MissingRequirementsPleaseInstallNotice";s:51:"Please install %1$s %2$s as it is required by %3$s.";s:17:"NoZipFileSelected";s:25:"Please select a ZIP file.";s:22:"FileExceedsUploadLimit";s:58:"The selected file exceeds the upload limit of your server.";s:19:"NumUpdatesAvailable";s:22:"%s Update(s) available";s:16:"NoPluginSettings";s:41:"No plugin settings that can be configured";s:6:"Origin";s:6:"Origin";s:10:"OriginCore";s:4:"Core";s:14:"OriginOfficial";s:8:"Official";s:16:"OriginThirdParty";s:11:"Third-party";s:14:"PluginHomepage";s:15:"Plugin Homepage";s:23:"PluginNotCompatibleWith";s:40:"%1$s plugin is not compatible with %2$s.";s:14:"PluginNotFound";s:36:"Plugin %1$s not found on filesystem.";s:25:"PluginNotFoundAlternative";s:142:"If you\'ve been using this plugin, try reuploading or reinstalling it from the marketplace. If not, click uninstall to remove it from the list.";s:27:"PluginNotWorkingAlternative";s:132:"If you\'ve been using this plugin, maybe you can find a more recent version in the Marketplace. If not, you may want to uninstall it.";s:17:"PluginRequirement";s:19:"%1$s requires %2$s.";s:17:"PluginsManagement";s:14:"Manage Plugins";s:15:"NotDownloadable";s:16:"Not downloadable";s:21:"PluginNotDownloadable";s:31:"The plugin is not downloadable.";s:31:"PluginNotDownloadablePaidReason";s:52:"Possible reasons are an expired or exceeded license.";s:22:"PluginRequiresInternet";s:146:"This plugin requires a working internet connection. Please check your config value for `enable_internet_features` if you want to use this feature.";s:15:"PluginActivated";s:16:"Plugin activated";s:6:"Status";s:6:"Status";s:21:"SuccessfullyActicated";s:52:"You have successfully activated <strong>%s</strong>.";s:17:"TeaserExtendPiwik";s:37:"Extend Matomo with Plugins and Themes";s:25:"TeaserExtendPiwikByPlugin";s:107:"Extend Matomo by %1$sinstalling plugins from the Marketplace%2$s or %3$supload a plugin in .zip format%4$s.";s:24:"TeaserExtendPiwikByTheme";s:62:"Enjoy another look and feel by %1$sinstalling a new theme%2$s.";s:41:"InstallingNewPluginViaMarketplaceOrUpload";s:101:"You may automatically install plugins from the Marketplace or %1$supload a plugin%2$s in .zip format.";s:27:"TagManagerNowAvailableTitle";s:35:"Matomo Tag Manager is now available";s:30:"TagManagerNowAvailableSubtitle";s:109:"Manage all your tags easily through one platform to get the insights you want, the opportunities are endless!";s:21:"ActivateTagManagerNow";s:24:"Activate Tag Manager now";s:34:"TagManagerEmailSuperUserToActivate";s:46:"Email Super Users to activate this new feature";s:29:"TagManagerTeaserHideSuperUser";s:33:"Do not show this page to any user";s:32:"TagManagerTeaserHideNonSuperUser";s:43:"Not interested, do not show this page again";s:34:"TagManagerTeaserEmailSuperUserBody";s:244:"Hi,%1$sMatomo Tag Manager is now available within Matomo and I would love to use this new feature. As you have Super User access, could you activate this feature through the Tag Manager page in the top menu?%2$sThe Matomo URL is %3$s.%4$sThanks";s:16:"WhatIsTagManager";s:22:"What is a Tag Manager?";s:24:"WhatIsTagManagerDetails1";s:349:"Similar to how a Content Management System (CMS) brings you all the flexibility to publish content for your website without having the technical HTML/CSS knowledge, a Tag Management System (TMS) is your go-to for simplifying the process of embedding first and third-party application tracking tags (also known as snippets or pixels) on your website.";s:24:"WhatIsTagManagerDetails2";s:269:"Say you want to see the results of your conversions/goals, newsletter signups, social widgets, exit popups and remarketing campaigns; what was once a highly technical and time-consuming process is now easily done within the TMS and takes only a few clicks to implement.";s:30:"TagManagerLearnMoreInUserGuide";s:40:"Learn more in the Tag Manager User Guide";s:19:"WhyUsingATagManager";s:18:"Why a Tag Manager?";s:27:"WhyUsingATagManagerDetails1";s:249:"A Tag Manager makes your life easier! You no longer need to wait on a developer to modify any first or third-party snippets on your website as the Tag Manager gives you a stress-free experience to make these changes and deploy your website yourself.";s:27:"WhyUsingATagManagerDetails2";s:114:"It couldn\'t be more convenient and it not only lets you bring changes to the market faster, but also reduces cost.";s:27:"WhyUsingATagManagerDetails3";s:101:"This keeps the marketing teams, digital teams and the IT guys happy... It’s a win-win for everyone!";s:16:"AreThereAnyRisks";s:20:"Are there any risks?";s:24:"AreThereAnyRisksDetails1";s:304:"When you activate the Tag Manager, users with admin access will be able to create custom HTML tags, triggers, and variables that may execute JavaScript on your website. These custom templates could be misused to steal, for example, sensitive information from your website visitors (known as %1$sXSS%2$s).";s:24:"AreThereAnyRisksDetails2";s:227:"You can disable these custom templates under "Administration => General Settings" once you have activated the Tag Manager. Alternatively, you can also restrict the usage of these templates to specific users or super users only.";s:5:"Theme";s:5:"Theme";s:6:"Themes";s:6:"Themes";s:17:"ThemesDescription";s:138:"Themes can change the appearance of Matomo user interface, and provide a completely new visual experience to enjoy your analytics reports.";s:16:"ThemesManagement";s:13:"Manage Themes";s:16:"UninstallConfirm";s:159:"You are about to uninstall a plugin %s. The plugin will be completely removed from your platform and it won\'t be recoverable. Are you sure you want to do this?";s:7:"Version";s:7:"Version";s:25:"ViewAllMarketplacePlugins";s:28:"View all Marketplace plugins";s:49:"WeCouldNotLoadThePluginAsItHasMissingDependencies";s:72:"The plugin %1$s could not be loaded as it has missing dependencies: %2$s";s:8:"Websites";s:8:"Websites";s:14:"UpdateSelected";s:15:"Update Selected";}s:11:"CoreUpdater";a:99:{s:24:"CheckingForPluginUpdates";s:31:"Checking for new plugin updates";s:25:"ClickHereToViewSqlQueries";s:95:"Click here to view and copy the list of SQL queries and console commands that will get executed";s:36:"CriticalErrorDuringTheUpgradeProcess";s:41:"Critical Error during the update process:";s:23:"DatabaseUpgradeRequired";s:25:"Database Upgrade Required";s:28:"DisablingIncompatiblePlugins";s:34:"Disabling incompatible plugins: %s";s:22:"DownloadingUpdateFromX";s:26:"Downloading update from %s";s:9:"DownloadX";s:11:"Download %s";s:9:"UpdateLog";s:10:"Update log";s:18:"EmptyDatabaseError";s:77:"Database %s is empty. You must edit or remove your Matomo configuration file.";s:12:"ErrorDIYHelp";s:75:"If you are an advanced user and encounter an error in the database upgrade:";s:14:"ErrorDIYHelp_1";s:89:"identify and correct the source of the problem (e.g., memory_limit or max_execution_time)";s:14:"ErrorDIYHelp_2";s:55:"execute the remaining queries in the update that failed";s:14:"ErrorDIYHelp_3";s:129:"manually update the `option` table in your Matomo database, setting the value of version_core to the version of the failed update";s:14:"ErrorDIYHelp_4";s:95:"re-run the updater (through the browser or command-line) to continue with the remaining updates";s:14:"ErrorDIYHelp_5";s:64:"report the problem (and solution) so that Matomo can be improved";s:25:"ErrorDuringPluginsUpdates";s:28:"Error during plugin updates:";s:29:"ExceptionAlreadyLatestVersion";s:37:"Your Matomo version %s is up to date.";s:21:"ExceptionArchiveEmpty";s:14:"Empty archive.";s:28:"ExceptionArchiveIncompatible";s:24:"Incompatible archive: %s";s:26:"ExceptionArchiveIncomplete";s:55:"Archive is incomplete: some files are missing (eg. %s).";s:27:"ExceptionDirWrongPermission";s:98:"Some folders are not writable. Please ensure the following folders are writable and try again: %s.";s:15:"FeedbackRequest";s:72:"Feel free to share your ideas and suggestions with the Matomo Team here:";s:18:"HelpMessageContent";s:220:"Check the %1$s Matomo FAQ %2$s which explains most common errors during update. %3$s Ask your system administrator - they may be able to help you with the error which is most likely related to your server or MySQL setup.";s:32:"HelpMessageIntroductionWhenError";s:110:"The above is the core error message. It should help explain the cause, but if you require further help please:";s:34:"HelpMessageIntroductionWhenWarning";s:145:"The update completed successfuly, however there were issues during the process. Please read the above descriptions for details. For further help:";s:39:"HighTrafficPiwikServerEnableMaintenance";s:159:"If you manage a high traffic Matomo server, we recommend to %1$smomentarily disable visitor Tracking and put the Matomo User Interface in maintenance mode%2$s.";s:37:"IncompatbilePluginsWillBeDisabledInfo";s:164:"Note: some plugins are not compatible with Matomo %s. We will update them if there is an update on the Marketplace, otherwise we will disable them when you upgrade:";s:26:"InstallingTheLatestVersion";s:29:"Installing the latest version";s:17:"LatestBetaRelease";s:19:"Latest beta release";s:19:"LatestStableRelease";s:21:"Latest stable release";s:20:"LatestXStableRelease";s:16:"Latest stable %s";s:18:"LatestXBetaRelease";s:14:"Latest beta %s";s:17:"LtsSupportVersion";s:25:"Long Term Support version";s:19:"ListOfSqlQueriesFYI";s:111:"FYI: these are the SQL queries and console commands that will be executed to upgrade your database to Matomo %s";s:29:"TheseSqlQueriesWillBeExecuted";s:35:"These SQL queries will be executed:";s:27:"TheseCommandsWillBeExecuted";s:35:"These console commands will be run:";s:19:"MajorUpdateWarning1";s:55:"This is a major update! It will take longer than usual.";s:19:"MajorUpdateWarning2";s:69:"The following advice is especially important for large installations.";s:17:"NeedHelpUpgrading";s:27:"Need help upgrading Matomo?";s:21:"NeedHelpUpgradingText";s:267:"If you need support to upgrade your Matomo, the creators of Matomo are here to help you make the Matomo upgrade a success and provide all instructions, best practises and ongoing support. %1$sContact the Matomo experts to get started upgrading your Matomo safely.%2$s";s:26:"NoteForLargePiwikInstances";s:46:"Important notes for large Matomo installations";s:32:"NotificationClickToUpdatePlugins";s:38:"Click here to update your plugins now:";s:31:"NotificationClickToUpdateThemes";s:37:"Click here to update your themes now:";s:38:"NotificationSubjectAvailableCoreUpdate";s:26:"New Matomo %s is available";s:40:"NotificationSubjectAvailablePluginUpdate";s:41:"Updates available for your Matomo plugins";s:32:"PiwikHasBeenSuccessfullyUpgraded";s:37:"Matomo has been successfully updated!";s:24:"PiwikUpdatedSuccessfully";s:28:"Matomo updated successfully!";s:41:"PiwikWillBeUpgradedFromVersionXToVersionY";s:75:"Matomo database will be upgraded from version %1$s to the new version %2$s.";s:9:"ReadyToGo";s:12:"Ready to go?";s:34:"TheFollowingPluginsWillBeUpgradedX";s:42:"The following plugins will be updated: %s.";s:37:"TheFollowingDimensionsWillBeUpgradedX";s:45:"The following dimensions will be updated: %s.";s:41:"ThereIsNewPluginVersionAvailableForUpdate";s:58:"Some plugins you use have been updated on the Marketplace:";s:35:"ThereIsNewVersionAvailableForUpdate";s:53:"There is a new version of Matomo available for update";s:38:"TheUpgradeProcessMayFailExecuteCommand";s:161:"If you have a large Matomo database, updates might take too long to run in the browser. In this situation, you can execute the updates from your command line: %s";s:45:"TheUpgradeProcessMayTakeAWhilePleaseBePatient";s:68:"The database upgrade process may take a while, so please be patient.";s:18:"UnpackingTheUpdate";s:20:"Unpacking the update";s:19:"UpdateAutomatically";s:20:"Update Automatically";s:33:"UpdateHasBeenCancelledExplanation";s:207:"Matomo One Click Update has been cancelled. If you can\'t fix the above error message, it is recommended that you manually update Matomo. %1$s Please check out the %2$sUpdate documentation%3$s to get started!";s:11:"UpdateTitle";s:6:"Update";s:25:"UpdatingPluginXToVersionY";s:36:"Updating plugin %1$s to version %2$s";s:18:"UpdateSuccessTitle";s:37:"Matomo has been successfully updated!";s:16:"UpdateErrorTitle";s:12:"Update error";s:19:"ThankYouUpdatePiwik";s:53:"Thank you for using Matomo and keeping it up to date!";s:17:"PostUpdateMessage";s:104:"Matomo will always be free to download and use, but it needs your continued support to grow and improve.";s:17:"PostUpdateSupport";s:69:"If you need help using Matomo, you can get support from its creators:";s:15:"ServicesSupport";s:20:"Services and support";s:12:"CloudHosting";s:13:"Cloud hosting";s:8:"Updating";s:8:"Updating";s:22:"UpdateUsingHttpsFailed";s:115:"Downloading the latest Matomo version over secure HTTPS connection did not succeed, because of the following error:";s:26:"UpdateUsingHttpsFailedHelp";s:362:"Why did it fail? Downloading the latest Matomo version (over secure HTTPS connection) can fail for various reasons, for example because of a network error, slow network speed or wrong system configuration. Note that it could also mean that your server is the target of a MITM attack and someone is trying to replace the update with a malicious version of Matomo.";s:34:"UpdateUsingHttpsFailedHelpWhatToDo";s:102:"It is recommended to retry the download using the secure HTTPS connection as it prevents MITM attacks.";s:10:"UsingHttps";s:47:"using the secure HTTPS connection (recommended)";s:9:"UsingHttp";s:36:"using the non-secure HTTP connection";s:15:"UpgradeComplete";s:17:"Upgrade complete!";s:12:"UpgradePiwik";s:14:"Upgrade Matomo";s:24:"ConsoleStartingDbUpgrade";s:87:"Starting the database upgrade process now. This may take a while, so please be patient.";s:20:"DbUpgradeNotExecuted";s:30:"Database upgrade not executed.";s:34:"ConsoleUpdateUnexpectedUserWarning";s:280:"It appears you have executed this update with user %1$s, while your Matomo files are owned by %2$s. 

To ensure that the Matomo files are readable by the correct user, you may need to run the following command (or a similar command depending on your server configuration):

$ %3$s";s:20:"ConsoleUpdateFailure";s:60:"Matomo could not be updated! See above for more information.";s:25:"ConsoleUpdateNoSqlQueries";s:62:"Note: There are no SQL queries or console commands to execute.";s:15:"AlreadyUpToDate";s:33:"Everything is already up to date.";s:16:"ExecuteDbUpgrade";s:47:"A database upgrade is required. Execute update?";s:6:"DryRun";s:23:"Note: this is a Dry Run";s:9:"DryRunEnd";s:14:"End of Dry Run";s:25:"ConsoleCommandDescription";s:128:"Triggers upgrades. Use it after Matomo core or any plugin files have been updated. Append --yes to upgrade without confirmation.";s:27:"ConsoleParameterDescription";s:59:"Directly execute the update without asking for confirmation";s:22:"VerifyingUnpackedFiles";s:28:"Verifying the unpacked files";s:15:"WarningMessages";s:17:"Warning messages:";s:45:"WeAutomaticallyDeactivatedTheFollowingPlugins";s:54:"We automatically deactivated the following plugins: %s";s:43:"YouCanUpgradeAutomaticallyOrDownloadPackage";s:91:"You can update to version %s automatically or download the package and install it manually:";s:38:"YouMustDownloadPackageOrFixPermissions";s:164:"Matomo is unable to overwrite your current installation. You can either fix the directory/file permissions, or download the package and install version %s manually:";s:23:"YourDatabaseIsOutOfDate";s:82:"Your Matomo database is out-of-date, and must be upgraded before you can continue.";s:20:"ViewVersionChangelog";s:36:"View the changelog for this version:";s:30:"ReceiveEmailBecauseIsSuperUser";s:72:"You receive this email because you are a Super User on the Matomo at: %s";s:16:"ConvertToUtf8mb4";s:35:"Convert database to UTF8mb4 charset";s:25:"TriggerDatabaseConversion";s:41:"Trigger database conversion in background";s:21:"Utf8mb4ConversionHelp";s:879:"Your database is currently not using utf8mb4 charset. This makes it impossible to store 4-byte characters, such as emojis, less common characters of asian languages, various historic scripts or mathematical symbols. Those are currently replaced with %1$s.<br /><br />Your database supports the utf8mb4 charset and it would be possible to convert it.<br /><br />If you are able to run console commands we recommend using this command: %2$s<br /><br />Alternatively you can enable the conversion here. It will then be triggered automatically as a scheduled task in the background.<br /><br />Attention: Converting the database might take up to a couple of hours depending on the database size. As tracking might not work during this process, we do not recommend to use the trigger for bigger instances.<br /><br />You can find more information about this topic in this %3$sFAQ%4$s.";s:18:"SkipCacheClearDesc";s:228:"Skips clearing of caches before updating. This is only useful if you can ensure that instances running this command have not created a cache at all yet, and if clearing the cache for many Matomo accounts can become a bottleneck.";s:14:"SkipCacheClear";s:25:"Skipping clearing caches.";}s:16:"CustomDimensions";a:43:{s:15:"CannotBeDeleted";s:55:"A Custom Dimension cannot be deleted, only deactivated.";s:24:"ColumnAvgTimeOnDimension";s:22:"Avg. Time On Dimension";s:19:"ColumnUniqueActions";s:14:"Unique Actions";s:18:"ConfigureDimension";s:36:"Configure %1$s Custom Dimension %2$s";s:21:"ConfigureNewDimension";s:25:"Configure a new dimension";s:17:"CustomDimensionId";s:25:"Custom Dimensions (Id %d)";s:16:"CustomDimensions";s:17:"Custom Dimensions";s:21:"CustomDimensionsIntro";s:81:"By creating %1$sCustom Dimensions%2$s you can collect any custom data for \'%3$s\'.";s:25:"CustomDimensionsIntroNext";s:323:"Matomo will create a report for each Custom Dimension (including the conversion rate for each of your Goals), as well as let you easily segment your users based on these values. Custom Dimensions are similar to %1$sCustom Variables%2$s but there are a few %3$sdifferences between Custom Dimensions and Custom Variables%4$s.";s:16:"DimensionCreated";s:24:"Custom Dimension created";s:16:"DimensionUpdated";s:24:"Custom Dimension updated";s:10:"EmptyValue";s:11:"empty value";s:29:"ExampleCreateCustomDimensions";s:93:"For example to create %s new Custom Dimensions in scope action execute the following command:";s:12:"ExampleValue";s:14:"dimensionValue";s:30:"ExceptionDimensionDoesNotExist";s:47:"Dimension %1$d for website %2$d does not exist.";s:29:"ExceptionDimensionIsNotActive";s:46:"Dimension %1$d for website %2$d is not active.";s:12:"ExtractValue";s:13:"Extract value";s:11:"Extractions";s:11:"Extractions";s:15:"ExtractionsHelp";s:587:"This is optional. A regex can be used to extract the value for this Custom Dimension from a page URL or page title automatically. This way, the custom dimension value does not have to be set manually via a Tracking client. A value still can be set manually via the Matomo Tracker API. Dimension values set manually in tracking clients always takes precedence over extractions. If multiple extractions are defined, the first extraction that matches is used. You don’t need to escape forward slashes as Matomo does this for you automatically. For example, use /news/ instead of \\/news\\/.";s:26:"HowToCreateCustomDimension";s:95:"To create a new Custom Dimension execute the following command within your Matomo installation:";s:31:"HowToManyCreateCustomDimensions";s:253:"If you want to create multiple new Custom Dimensions at once, simply append the number of dimensions that shall be created. As all database changes will be executed in one statement, it may not take much longer to add multiple Custom Dimensions at once.";s:23:"HowToTrackManuallyTitle";s:44:"Tracking a value for this dimension manually";s:25:"HowToTrackManuallyViaHttp";s:117:"To track a value via the HTTP Tracker API use the tracking parameter \'dimension\' followed by the Custom Dimension Id:";s:23:"HowToTrackManuallyViaJs";s:48:"To track a value in the JavaScript Tracker call:";s:30:"HowToTrackManuallyViaJsDetails";s:84:"For more information read t