des the live visits log and lets you watch your visitors live in the real-time dashboard widget. A visitor profile can be browsed for any given user.";s:15:"PreviousVisitor";s:16:"Previous visitor";s:16:"RealTimeVisitors";s:16:"Real-time Visits";s:20:"RealTimeVisitorCount";s:23:"Real-time visitor count";s:12:"Referrer_URL";s:12:"Referrer URL";s:7:"ShowMap";s:8:"show map";s:18:"ActionsAndDuration";s:20:"%1$s actions in %2$s";s:28:"SimpleRealTimeWidget_Message";s:30:"%1$s and %2$s in the last %3$s";s:18:"ViewVisitorProfile";s:20:"View visitor profile";s:21:"DisableVisitorProfile";s:25:"Turn off visitor profiles";s:32:"DisableVisitorProfileDescription";s:48:"All visits-log related features always function.";s:12:"VisitedPages";s:13:"Visited pages";s:14:"RevisitedPages";s:27:"Pages viewed more than once";s:13:"ToggleActions";s:32:"Toggle visibility of all actions";s:15:"TopVisitedPages";s:18:"Most visited pages";s:9:"VisitsLog";s:10:"Visits Log";s:26:"DisableVisitsLogAndProfile";s:40:"Turn off visits log and visitor profiles";s:37:"DisableVisitsLogAndProfileDescription";s:199:"Also removes features that depend on these, like the e-commerce log, the segmented visits-log, the real-time map or the real-time widget. May be required to comply with local privacy laws/guidelines.";s:29:"QueryMaxExecutionTimeExceeded";s:32:"Could not run the query in time.";s:44:"QueryMaxExecutionTimeExceededReasonDateRange";s:42:"Maybe the selected date range is too wide?";s:42:"QueryMaxExecutionTimeExceededReasonSegment";s:51:"Maybe the selected segment didn\'t match any visits?";s:42:"QueryMaxExecutionTimeExceededReasonUnknown";s:90:"Please try again. Get in touch with your administrator or support if the problem persists.";s:10:"VisitorLog";s:10:"Visits Log";s:23:"VisitorLogDocumentation";s:342:"This table shows the latest visits within the selected date range. Hover over the date of a vist to find out when the most recent one occured. %1$s If the date range includes today, you can see your visitors in real-time. %2$s The data displayed here is always live, regardless of whether and how often you make use of the archiving cron-job.";s:29:"VisitorLogNoDataMessagePurged";s:214:"The data has likely been purged because the regular deletion of old raw data is on, and the date for this report is more than %s days old. A superuser can change this setting by going to Administration → Privacy.";s:14:"VisitorProfile";s:15:"Visitor profile";s:18:"VisitorsInRealTime";s:19:"Visits in real-time";s:17:"VisitorsLastVisit";s:29:"Also visited %s days earlier.";s:10:"VisitsFrom";s:24:"%1$s%2$s visits%3$s from";s:12:"VisitSummary";s:91:"Spent a total of %1$s%2$s on the website%3$s, and viewed %4$s pages%5$s in %6$s visits%7$s.";s:29:"VisitSummaryWithActionDetails";s:103:"Spent a total of %1$s%2$s on the website%3$s, and performed %4$s actions%5$s (%6$s) in %7$s visits%8$s.";s:23:"RowActionTooltipDefault";s:41:"Show the visits log segmented by this row";s:29:"RowActionTooltipWithDimension";s:40:"Show the visits log segmented by this %s";s:21:"RowActionTooltipTitle";s:29:"Open the segmented visits log";s:24:"SegmentedVisitorLogTitle";s:46:"Visits log showing visits where %1$s is "%2$s"";s:12:"OnClickPause";s:35:"%s is running… Click to pause it.";s:12:"OnClickStart";s:33:"%s is stopped. Click to start it.";s:21:"ClickToSeeAllContents";s:48:"Click to see each content interaction/impression";s:26:"VisitorLogSubcategoryHelp1";s:243:"The visits log shows you every visit your website receives in detail. Find out which actions each visitor has performed, how they got to your site, a bit about who they are, and more (while still complying with your local privacy regulations).";s:26:"VisitorLogSubcategoryHelp2";s:231:"While other reports in Matomo show how your visitors behave at an aggregate level, the visits log provides granular detail. You can also use segments to narrow it down to specific types of visits to understand your visitors better.";s:26:"VisitorLogSubcategoryHelp3";s:34:"Learn more in the visit-log guide.";s:13:"RealTimeHelp1";s:197:"The visits in the real-time report show the real-time flow of visits to your website. It includes a real-time counter of your visits and page views in the last 24 hours and the previous 30 minutes.";s:13:"RealTimeHelp2";s:151:"This report refreshes every 5 seconds and displays new visits (or existing visitors that view a new page) at the top of the list with a fade-in effect.";}s:5:"Login";a:69:{s:13:"BruteForceLog";s:15:"Brute Force Log";s:20:"ConfirmationLinkSent";s:87:"Open the confirmation link sent to your e-mail inbox to confirm changing your password.";s:12:"ContactAdmin";s:113:"Possible reason: your host may have disabled the mail() function. <br />Please contact your Matomo administrator.";s:51:"ExceptionInvalidSuperUserAccessAuthenticationMethod";s:78:"A user with superuser access cannot be authenticated using the \'%s\' mechanism.";s:32:"ExceptionPasswordMD5HashExpected";s:68:"The password parameter is expected to be a MD5 hash of the password.";s:17:"InvalidNonceToken";s:112:"The form security failed because of a token mismatch. Please reload the form and check that your cookies are on.";s:20:"InvalidNonceReferrer";s:371:"The form security failed because of an invalid "Referer" header. If you are using a proxy server, you must %1$sconfigure Matomo to accept the proxy header%2$s that forwards the host header. Also, check that your "Referer" header is sent correctly. If you previously connected using HTTPS, please ensure you are connecting over a secure (SSL/TLS) connection and try again.";s:30:"InvalidNonceUnexpectedReferrer";s:123:"The form security failed because the "Referer" header is different from what was expected. Check that it is sent correctly.";s:18:"InvalidNonceOrigin";s:175:"The form security failed because of invalid origin. If you previously connected using HTTPS, please ensure you are connecting over a secure (SSL/TLS) connection and try again.";s:28:"InvalidNonceSSLMisconfigured";s:114:"Also, you may %1$sforce Matomo to use a secure connection%2$s: in your config file%3$s set %4$s below section %5$s";s:21:"InvalidOrExpiredToken";s:36:"The token is invalid or has expired.";s:23:"InvalidOrExpiredTokenV2";s:58:"The password has already been set or the link has expired.";s:20:"InvalidUsernameEmail";s:35:"Invalid username or e-mail address.";s:5:"LogIn";s:7:"Sign in";s:12:"LoginOrEmail";s:18:"Username or e-mail";s:11:"HelpIpRange";s:126:"Enter one IP address or one IP range per line. You can use CIDR notation e.g: %1$s or you can use wildcards, e.g: %2$s or %3$s";s:23:"SettingBruteForceEnable";s:28:"Enable Brute-force Detection";s:27:"SettingBruteForceEnableHelp";s:191:"Logs out users making too many password guesses within a timeframe for a while. This prevents anyone from testing all combinations. Getting a shared IP blocked also locks out its other users.";s:28:"SettingBruteForceWhitelistIp";s:37:"Never block these IPs from logging in";s:28:"SettingBruteForceBlacklistIp";s:38:"Always block these IPs from logging in";s:28:"NotAllowListTakesPrecendence";s:76:"If an IP is on both the list of IPs to block and never block, it is blocked.";s:32:"SettingBruteForceMaxFailedLogins";s:57:"Number of allowed login retries within a given time frame";s:36:"SettingBruteForceMaxFailedLoginsHelp";s:101:"Blocks the IP if more than this number of failed logins are recorded within the time frame set below.";s:26:"SettingBruteForceTimeRange";s:53:"Count login retries within this time range in minutes";s:30:"SettingBruteForceTimeRangeHelp";s:26:"Enter a number of minutes.";s:20:"ConfirmPasswordReset";s:14:"Reset password";s:25:"ConfirmPasswordResetIntro";s:91:"Please type your new password to confirm you really requested having your password changed.";s:33:"ConfirmPasswordResetWrongPassword";s:183:"The entered password does not match your newly made one. Reset your password again if you don\'t remember it. Don\'t do anything to keep your password if you didn\'t request changing it.";s:29:"LoginNotAllowedBecauseBlocked";s:67:"Too many failed logins. Please wait and try logging in again later.";s:19:"CurrentlyBlockedIPs";s:11:"Blocked IPs";s:16:"IPsAlwaysBlocked";s:28:"These IPs are always blocked";s:13:"UnblockAllIPs";s:23:"Unblock all blocked IPs";s:30:"CurrentlyBlockedIPsUnblockInfo";s:69:"You can unblock IPs blocked by mistake to allow them to log in again.";s:33:"CurrentlyBlockedIPsUnblockConfirm";s:24:"Unblock all blocked IPs?";s:23:"LoginPasswordNotCorrect";s:31:"Wrong username and/or password.";s:16:"LostYourPassword";s:19:"Lost your password?";s:18:"ChangeYourPassword";s:20:"Change your password";s:23:"MailPasswordChangeBody2";s:217:"Hi %1$s,

