g for the DOMContentLoaded event after the webpage was loaded and the user can already interact with it.";s:23:"ColumnAverageTimeOnLoad";s:17:"Avg. on load time";s:36:"ColumnAverageTimeOnLoadDocumentation";s:170:"Average time (in seconds) it takes the browser to execute Javascript code waiting for the window.load event. This event is triggered once the DOM has completely rendered.";s:26:"ColumnViewsWithTimeNetwork";s:27:"Pageviews with network time";s:25:"ColumnViewsWithTimeServer";s:26:"Pageviews with server time";s:27:"ColumnViewsWithTimeTransfer";s:28:"Pageviews with transfer time";s:32:"ColumnViewsWithTimeDomProcessing";s:34:"Pageviews with DOM processing time";s:32:"ColumnViewsWithTimeDomCompletion";s:34:"Pageviews with DOM completion time";s:25:"ColumnViewsWithTimeOnLoad";s:27:"Pageviews with on load time";s:17:"ColumnTimeNetwork";s:12:"Network time";s:16:"ColumnTimeServer";s:11:"Server time";s:18:"ColumnTimeTransfer";s:13:"Transfer time";s:23:"ColumnTimeDomProcessing";s:19:"DOM processing time";s:23:"ColumnTimeDomCompletion";s:19:"DOM completion time";s:16:"ColumnTimeOnLoad";s:12:"On load time";s:12:"PageLoadTime";s:14:"Page load time";s:19:"EvolutionOverPeriod";s:37:"Evolution of page performance metrics";s:17:"PluginDescription";s:34:"Adds some page performance reports";s:16:"PerformanceTable";s:30:"Table with performance metrics";s:8:"Overview";s:20:"Performance overview";s:21:"OverviewDocumentation";s:219:"This report provides an overview of how fast your webpages become visible to your visitors. This includes both how long it takes for browsers to download your webpages and how long it takes for browsers to display them.";s:11:"Performance";s:11:"Performance";s:8:"HelpNote";s:111:"Some of those metrics might not always be available. You can find more information in our %1$sonline guide%2$s.";s:14:"RowActionTitle";s:28:"Open page performance report";s:20:"RowActionDescription";s:41:"Show page performance report for this row";s:20:"PagePerformanceTitle";s:42:"Page performance for page with %1$s "%2$s"";s:27:"PerformanceSubcategoryHelp1";s:197:"The Performance section can help you analyse how fast your website or app is performing on the whole and help discover whether you have specific pages that significantly deviate from your averages.";s:27:"PerformanceSubcategoryHelp2";s:138:"You can also find reports showing exactly how long each page of your website takes to load and what is contributing to their loading time.";}s:14:"PrivacyManager";a:205:{s:13:"AnonymizeData";s:14:"Anonymize data";s:22:"AnonymizeIpDescription";s:74:"Select "Yes" if you want Matomo not to track fully qualified IP-Addresses.";s:21:"AnonymizeIpInlineHelp";s:102:"Anonymize the last byte(s) of visitors IP addresses to comply with your local privacy laws/guidelines.";s:23:"AnonymizeIpExtendedHelp";s:250:"When users visit your website, Matomo will not use the full IP address (such as %1$s) but instead Matomo will anonymize it first (to %2$s). IP address anonymisation is one of the requirements set by the privacy laws in some countries such as Germany.";s:31:"AnonymizeIpMaskLengtDescription";s:60:"Select how many bytes of the visitors\' IPs should be masked.";s:21:"AnonymizeIpMaskLength";s:24:"%1$s byte(s) - e.g. %2$s";s:20:"AnonymizeIpMaskFully";s:21:"Fully mask IP address";s:17:"AnonymizeReferrer";s:18:"Anonymize Referrer";s:21:"AnonymizeReferrerNote";s:549:"Matomo stores from which URL (referrer) a user comes to your site. In some cases such a URL may contain information that can be considered personal information. If you want to prevent such information to be tracked you can restrict the amount of referrer data that Matomo will store when a visitor enters your website. The more information is removed from the referrer information, the less likely personal information will be recorded. The more information you remove from the referrer, the less clear it will be how a visitor came to your website.";s:16:"AskingForConsent";s:18:"Asking for consent";s:18:"ConsentExplanation";s:97:"Consent means offering individuals choice and control about how their personal data is processed.";s:17:"ClickHereSettings";s:37:"Click here to access the %s settings.";s:18:"WhenDoINeedConsent";s:39:"When do I need to ask for user consent?";s:20:"WhenConsentIsNeeded1";s:466:"In the context of the %1$sGDPR privacy regulations%2$s, when you are processing personal data, in some cases you will need to ask for your users\' consent. To identify whether you need to ask for consent, you need to determine whether your lawful basis for processing personal data is "Consent" or "Legitimate interest", or whether you can avoid collecting personal data altogether. We recommend to learn more about the %3$slawful basis under the GDPR for Matomo%4$s.";s:20:"WhenConsentIsNeeded2";s:213:"Note that when you require to have your users\' consents and if you cannot prove that you got the "Consent" of your users in the past, then we recommend to %1$sanonymise your previously tracked users\' raw data%2$s.";s:19:"HowDoIAskForConsent";s:31:"How do I ask users for consent?";s:31:"HowDoIAskForConsentIntroduction";s:94:"Learn everything about %1$sasking for cookie or tracking consent in our integration guide.%2$s";s:14:"AnonymizeSites";s:34:"Anonymize the data of this site(s)";s:20:"AnonymizeRowDataFrom";s:37:"Anonymize all raw data starting from:";s:18:"AnonymizeRowDataTo";s:29:"Anonymize all raw data up to:";s:28:"AnonymizeReferrerExcludeNone";s:28:"Don\'t anonymize the referrer";s:29:"AnonymizeReferrerExcludeQuery";s:41:"Remove query parameters from referrer URL";s:28:"AnonymizeReferrerExcludePath";s:38:"Keep only the domain of a referrer URL";s:27:"AnonymizeReferrerExcludeAll";s:67:"Don\'t record the referrer URL but still detect the type of referrer";s:11:"AnonymizeIp";s:12:"Anonymize IP";s:15:"AnonymizeIpHelp";s:292:"This action cannot be undone. If enabled, for all visits during this duration the IP will be anonymized by at least 2 bytes, for example \'192.168.xxx.xxx\'. If you have currently configured to anonymize by 3 bytes, then this setting will be respected and all IPs will be anonymized by 3 bytes.";s:17:"AnonymizeLocation";s:18:"Anonymize Location";s:21:"AnonymizeLocationHelp";s:131:"This action cannot be undone. Re-evaluates the location based on the anonymized IP (at least 2 bytes of the IP will be anonymized).";s:15:"AnonymizeUserId";s:32:"Replace User ID with a pseudonym";s:19:"AnonymizeUserIdHelp";s:593:"When you enable this option, the User ID will be replaced by a pseudonym to avoid directly storing and displaying personally identifiable information such as an email address. In technical terms: given your User ID, Matomo will process the User ID pseudonym using a salted hash function.<br/><br/><em>Note: replacing with a pseudonym is not the same as anonymisation. In GDPR terms: the User ID pseudonym still counts as personal data. The original User ID could still be identified if certain additional information is available (which only Matomo and your data processor has access to).</em>";s:20:"AnonymizeProcessInfo";s:204:"This action may take a long time and will therefore not be executed right away. You will be able to follow the current state of the process below. The anonymization should typically start within one hour.";s:16:"AnonymizeDataNow";s:50:"Anonymize past data for the selected site and time";s:20:"AnonymizeDataConfirm";s:190:"Are you sure you want to anonymize the data for the selected website(s) and time range? This action cannot be undone, data may be deleted as requested, and this process may take a long time.";s:17:"UnsetVisitColumns";s:19:"Unset visit columns";s:21:"UnsetVisitColumnsHelp";s:263:"This action cannot be undone. A list of database columns in scope visit that you want to unset. Each value for that column will be set to its default value. Please note that if the same column exists in scope \'conversion\', then this column will be deleted as well";s:18:"UnsetActionColumns";s:20:"Unset action columns";s:22:"UnsetActionColumnsHelp";s:157:"This action cannot be undone. A list of database columns in scope action that you want to unset. Each value for that column will be set to its default value.";s:22:"AwarenessDocumentation";s:29:"Awareness &amp; documentation";s:27:"AwarenessDocumentationIntro";s:123:"Inform your users clearly and transparently, and make your colleagues aware of the data being collected and how it is used:";s:27:"AwarenessDocumentationDesc1";s:95:"Inform your visitors through a clear privacy notice whenever you’re collecting personal data.";s:27:"AwarenessDocumentationDesc2";s:94:"Inform your users in your privacy policy about what data you collect and how the data is used.";s:27:"AwarenessDocumentationDesc3";s:125:"Make your team aware that you are using Matomo Analytics and %1$swhat data is being collected by your analytics platform%2$s.";s:27:"AwarenessDocumentationDesc4";s:75:"Document your use of Matomo within your %1$sinformation asset register%2$s.";s:13:"CurrentDBSize";s:21:"Current database size";s:13:"DataRetention";s:14:"Data retention";s:21:"DataRetentionInMatomo";s:41:"Data retention for data stored in Matomo:";s:20:"DataRetentionOverall";s:405:"The overall data retention rate for your privacy policy is the raw data retention rate. Please note that aggregated reports may contain personal data as well. If you are using features like User ID, Custom Variables, Custom Dimension, or track personal data in other ways such as events, page URLs or page titles, etc, then the overall data retention rate for your privacy policy is the higher of the two.";s:19:"RawDataRemovedAfter";s:55:"all visits and actions raw data are deleted after %1$s.";s:19:"RawDataNeverRemoved";s:63:"visits and actions raw data are <strong>never</strong> deleted.";s:19:"ReportsRemovedAfter";s:46:"all aggregated reports are deleted after %1$s.";s:19:"ReportsNeverRemoved";s:54:"aggregated reports are <strong>never</strong> deleted.";s:8:"DBPurged";s:10:"DB purged.";s:17:"DeleteBothConfirm";s:176:"You are about to enable both raw data deletion and report data deletion. This will permanently remove your ability to view old analytics data. Are you sure you want to do this?";s:21:"DeleteDataDescription";s:156:"You can configure Matomo to regularly delete old raw data and/or aggregated reports to keep your database small or to meet privacy regulations such as GDPR.";s:18:"DeleteDataInterval";s:21:"Delete old data every";s:20:"DeleteOldVisitorLogs";s:23:"Delete old visitor logs";s:16:"DeleteOldRawData";s:29:"Regularly delete old raw data";s:26:"DeleteOldAggregatedReports";s:33:"Delete old aggregated report data";s:21:"DeleteLogDescription2";s:133:"When you enable automatic log deletion, you must ensure that all previous daily reports have been processed, so that no data is lost.";s:17:"DeleteRawDataInfo";s:389:"The raw data contains all details about each individual visit and each action your visitors took. When you delete raw data, the deleted information won\'t be available anymore in the visitor log. Also if you later decide to create a segment, the segmented reports won\'t become available for the time frame that has been deleted since all aggregated reports are generated from this raw data.";s:17:"DeleteLogsConfirm";s:206:"You are about to enable raw data deletion. If old raw data is removed, and reports haven\'t already been created, you will not be able to see historical past analytics data. Are you sure you want to do this?";s:19:"DeleteLogsOlderThan";s:22:"Delete logs older than";s:13:"DeleteMaxRows";s:44:"Maximum number of rows to delete in one run:";s:20:"DeleteMaxRowsNoLimit";s:8:"no limit";s:20:"DeleteReportsConfirm";s:160:"You are about to enable report data deletion. If old reports are removed, you will have to re-process them in order view them. Are you sure you want to do this?";s:34:"DeleteAggregateReportsDetailedInfo";s:299:"When you enable this setting, all aggregated reports will be deleted. Aggregated reports are generated from the raw data and represent aggregated data from several individual visits. For example, the "Country" report lists aggregated numbers to see how many visits you have gotten from each country.";s:35:"KeepBasicMetricsReportsDetailedInfo";s:87:"When you enable this setting, some numeric key performance indicators won\'t be deleted.";s:35:"InfoSomeReferrerInfoMayBeAnonymized";s:99:"Some referrer information may be missing because referrer anonymisation is enabled as following: %s";s:18:"DeleteReportsInfo2";s:99:"If you delete old reports, they may be re-processed again from your RAW data when you request them.";s:18:"DeleteReportsInfo3";s:94:"If you have also enabled "%s", then the reports data you\'re deleting will be permanently lost.";s:22:"DeleteReportsOlderThan";s:25:"Delete reports older than";s:24:"DeleteSchedulingSettings";s:26:"Schedule old data deletion";s:18:"DeleteDataSettings";s:35:"Delete old visitor logs and reports";s:22:"DoNotTrack_Description";s:191:"Do Not Track is a technology and policy proposal that enables users to opt out of tracking by websites they do visit, including analytics services, advertising networks, and social platforms.";s:18:"DoNotTrack_Disable";s:28:"Disable Do Not Track support";s:19:"DoNotTrack_Disabled";s:120:"Matomo is currently tracking all visitors, even when they specified "I do not want to be tracked" in their web browsers.";s:27:"DoNotTrack_DisabledMoreInfo";s:74:"We recommend enabling DoNotTrack support to respect your visitors\' privacy";s:17:"DoNotTrack_Enable";s:27:"Enable Do Not Track support";s:18:"DoNotTrack_Enabled";s:55:"You are currently respecting your users Privacy, Bravo!";s:26:"DoNotTrack_EnabledMoreInfo";s:135:"When users have set their web browser to "I do not want to be tracked" (DoNotTrack is enabled) then Matomo will not track these visits.";s:31:"DoNotTrack_SupportDNTPreference";s:31:"Support Do Not Track preference";s:25:"EstimatedDBSizeAfterPurge";s:35:"Estimated database size after purge";s:19:"EstimatedSpaceSaved";s:21:"Estimated space saved";s:23:"ForceCookielessTracking";s:30:"Force tracking without cookies";s:34:"ForceCookielessTrackingDescription";s:199:"Enabling this option will automatically update %1$s, so it contains some additional code to ensure all trackers won\'t use cookies. Additionally Matomo will ignore all tracking cookies on server side.";s:35:"ForceCookielessTrackingDescription2";s:151:"Cookies will be disabled even when using the consent methods in Matomo tracker and calling for example the cookie consent methods won\'t enable cookies.";s:45:"ForceCookielessTrackingDescriptionNotWritable";s:364:"The JS tracker file "%1$s" is not writable which is required for this feature to fully work. When the JS tracker file is not writable, then the cookies will be only ignored on the server side but cookies might be still set in the browser. To solve this issue you or a system administrator need to change the file permissions so your webserver can change this file.";s:26:"GeolocationAnonymizeIpNote";s:136:"Note: Geolocation will have approximately the same results with 1 byte anonymized. With 2 bytes or more, Geolocation will be inaccurate.";s:4:"GDPR";s:4:"GDPR";s:11:"GdprManager";s:12:"GDPR Manager";s:14:"GdprChecklists";s:15:"GDPR checklists";s:18:"GdprChecklistDesc1";s:187:"If you are processing personal data of European citizens through Matomo, even if your company is located outside Europe, you need to fulfill GDPR obligations and this guide will help you.";s:18:"GdprChecklistDesc2";s:242:"Find below our tools that let you exercise your users’ rights easily, and the list of actions to take in order to make your use of Matomo compliant with the GDPR and safeguard your data. Visit our %1$sGDPR User guide%2$s to learn even more.";s:12:"GdprOverview";s:13:"GDPR Overview";s:18:"GdprOverviewIntro1";s:159:"The General Data Protection Regulation (GDPR) is a regulation which strengthens and unifies data protection for all individuals within the European Union (EU).";s:18:"GdprOverviewIntro2";s:193:"If you take steps to ensure no personal data is collected in Matomo, then you may not be concerned by the GDPR for Matomo (if you track no IP addresses, no user IDs, no geolocation data, etc.).";s:9:"GdprTools";s:10:"GDPR Tools";s:16:"GetPurgeEstimate";s:18:"Get purge estimate";s:17:"IndividualsRights";s:19:"Individuals\' rights";s:22:"IndividualsRightsIntro";s:68:"Exercise the rights of your users with our GDPR-friendly procedures:";s:23:"IndividualsRightsInform";s:72:"The right to be informed: inform your users with a clear privacy notice.";s:23:"IndividualsRightsAccess";s:84:"The right of access: %1$ssearch for a data subject%2$s and export all of their data.";s:24:"IndividualsRightsErasure";s:93:"The right to erasure: %1$ssearch for a data subject%2$s and delete some or all of their data.";s:30:"IndividualsRightsRectification";s:107:"The right to rectification: you can %1$ssearch for a data subject%2$s and delete some or all of their data.";s:28:"IndividualsRightsPortability";s:94:"The right to data portability: %1$ssearch for a data subject%2$s and export all of their data.";s:23:"IndividualsRightsObject";s:87:"The right to object: %1$slet your users easily opt-out%2$s on your privacy policy page.";s:25:"IndividualsRightsChildren";s:207:"If you offer online services to children and rely on consent to collect information about them, then you may need a parent or guardian’s consent in order to process the children’s personal data lawfully.";s:16:"KeepBasicMetrics";s:99:"Keep basic metrics (visits, page views, bounce rate, goal conversions, ecommerce conversions, etc.)";s:11:"KeepDataFor";s:17:"Keep all data for";s:18:"KeepReportSegments";s:48:"For kept data above, also keep segmented reports";s:10:"LastDelete";s:20:"Last deletion was on";s:14:"LeastDaysInput";s:48:"Please specify a number of days greater than %s.";s:16:"LeastMonthsInput";s:50:"Please specify a number of months greater than %s.";s:19:"MenuPrivacySettings";s:7:"Privacy";s:10:"NextDelete";s:26:"Next scheduled deletion in";s:17:"PluginDescription";s:108:"Increase Privacy for your users and make your Matomo instance privacy compliant with your local legislation.";s:8:"PurgeNow";s:12:"Purge DB Now";s:15:"PurgeNowConfirm";s:95:"You are about to permanently delete data from your database. Are you sure you want to continue?";s:11:"PurgingData";s:15:"Purging data...";s:21:"RecommendedForPrivacy";s:23:"Recommended for privacy";s:24:"ReportsDataSavedEstimate";s:13:"Database size";s:20:"SearchForDataSubject";s:25:"Search for a data subject";s:18:"FindDataSubjectsBy";s:21:"Find data subjects by";s:19:"NoDataSubjectsFound";s:22:"No data subjects found";s:19:"DeleteVisitsConfirm";s:82:"Are you sure you want to delete the selected visits? This action cannot be undone.";s:15:"ResultTruncated";s:88:"More than %1$s results were found and the result was truncated to the first %1$s visits.";s:20:"AddVisitorIdToSearch";s:41:"Click to add this visitorID to the search";s:20:"AddVisitorIPToSearch";s:41:"Click to add this visitorIP to the search";s:17:"AddUserIdToSearch";s:38:"Click to add this userID to the search";s:20:"ExportSelectedVisits";s:22:"Export selected visits";s:20:"DeleteSelectedVisits";s:22:"Delete selected visits";s:13:"SelectWebsite";s:16:"Select a website";s:20:"MatchingDataSubjects";s:22:"Matching data subjects";s:21:"VisitsMatchedCriteria";s:41:"These visits match the selected criteria.";s:13:"ExportingNote";s:180:"In case you are exporting the data to exercise the right of access, please make sure the selected visits are actually performed by the data subject you want to export the data for.";s:22:"DeletionFromMatomoOnly";s:242:"Please also note that any data will be only deleted from the Matomo database but not from your webserver logs. Also note that if you re-import any historical data, for example from logs, that any previously deleted data may be imported again.";s:23:"ResultIncludesAllVisits";s:84:"The found results include all visits without any time restriction and include today.";s:19:"GdprToolsPageIntro1";s:77:"This page has been designed in order for you to exercise data subject rights.";s:19:"GdprToolsPageIntro2";s:81:"Here you can exercise the rights of your users with our GDPR-friendly procedures:";s:29:"GdprToolsPageIntroAccessRight";s:77:"the right of access to all of their data (and the right to data portability),";s:28:"GdprToolsPageIntroEraseRight";s:78:"the right to erase some or all of their data (and the right to rectification).";s:21:"GdprToolsOverviewHint";s:80:"In case you do not know what GDPR is, please refer to the %1$sGDPR overview%2$s.";s:23:"SaveSettingsBeforePurge";s:86:"You have changed the data deletion settings. Please save them before starting a purge.";s:30:"SeeAlsoOurOfficialGuidePrivacy";s:58:"See also our official guide: %1$sWeb Analytics Privacy%2$s";s:18:"SecurityProcedures";s:19:"Security procedures";s:23:"SecurityProceduresIntro";s:123:"Inform your users clearly and transparently, and make your colleagues aware of the data being collected and how it is used:";s:23:"SecurityProceduresDesc1";s:82:"Apply our %1$ssecurity recommendations%2$s in order to keep your Matomo data safe.";s:23:"SecurityProceduresDesc2";s:157:"Check that you have a written contract with the company providing you the Matomo server or hosting which ensures %1$sappropriate safeguards are provided%2$s.";s:23:"SecurityProceduresDesc3";s:53:"Include Matomo in your %1$sdata breach procedure%2$s.";s:23:"SecurityProceduresDesc4";s:84:"Include Matomo in your %1$sdata privacy impact assessment (DPIA)%2$s, if applicable.";s:12:"TeaserHeader";s:261:"On this page, you can customize Matomo to make it privacy compliant with existing legislations, by: %1$s anonymizing the visitor IP%2$s, %3$s automatically remove old visitor logs from the database%4$s, and %5$s anonymize previously tracked raw users\' data%6$s.";s:14:"TeaserHeadline";s:16:"Privacy Settings";s:33:"UseAnonymizedIpForVisitEnrichment";s:59:"Also use the Anonymized IP addresses when enriching visits.";s:37:"UseAnonymizedIpForVisitEnrichmentNote";s:269:"Plugins such as Geo Location via IP and Provider improve visitor\'s metadata. By default, these plugins use the anonymized IP addresses. If you select \'No\', then the non-anonymized full IP address will be used instead, resulting in less privacy but better data accuracy.";s:22:"PseudonymizeUserIdNote";s:287:"When you enable this option, the User ID will be replaced by a pseudonym to avoid directly storing and displaying personally identifiable information such as an email address. In technical terms: given your User ID, Matomo will process the User ID pseudonym using a salted hash function.";s:23:"PseudonymizeUserIdNote2";s:287:"Note: replacing with a pseudonym is not the same as anonymisation. In GDPR terms: the User ID pseudonym still counts as personal data. The original User ID could still be identified if certain additional information is available (which only Matomo and your data processor has access to).";s:20:"AnonymizeOrderIdNote";s:274:"Because an Order ID can be cross-referenced with another system, typically an ecommerce shop, the Order ID may count as personal information under the GDPR. When you enable this option, an Order ID will be automatically anonymized so no personal information will be tracked.";s:14:"UseAnonymizeIp";s:32:"Anonymize Visitors\' IP addresses";s:24:"UseAnonymizeTrackingData";s:23:"Anonymize Tracking Data";s:18:"UseAnonymizeUserId";s:17:"Anonymize User ID";s:18:"PseudonymizeUserId";s:32:"Replace User ID with a pseudonym";s:16:"OptOutAppearance";s:32:"Customize the opt-out appearance";s:15:"OptOutCustomize";s:28:"Customize the opt-out iframe";s:14:"OptOutHtmlCode";s:34:"HTML code to embed on your website";s:13:"OptOutPreview";s:56:"Preview of the Opt-out as it will appear on your website";s:25:"OptOutCodeTypeExplanation";s:321:"The opt-out can either be set by u