ription";s:43:"A link to your Terms &amp; Conditions page.";s:33:"PrivacyPolicyUrlDescriptionSuffix";s:115:"If you set this, it will be displayed at the bottom of the login page and on pages that the \'%1$s\' user can access.";s:21:"ShowInEmbeddedWidgets";s:24:"Show in embedded widgets";s:32:"ShowInEmbeddedWidgetsDescription";s:126:"If checked, a link to your Privacy Policy and your Terms &amp; Conditions will be displayed at the bottom of embedded widgets.";s:7:"Imprint";s:7:"Imprint";s:13:"PrivacyPolicy";s:14:"Privacy Policy";s:18:"TermsAndConditions";s:22:"Terms &amp; Conditions";s:26:"VisitsSuccessfullyExported";s:33:"Visits were successfully exported";s:25:"VisitsSuccessfullyDeleted";s:32:"Visits were successfully deleted";s:10:"LastAction";s:11:"Last action";s:24:"FindMatchingDataSubjects";s:27:"Find matching data subjects";s:14:"ConsentManager";s:15:"Consent Manager";s:22:"ConsentManagerDetected";s:133:"%1$s consent manager was detected on your website. To learn about configuring Matomo to work with %1$s please read %2$sthis guide%3$s";s:23:"ConsentManagerConnected";s:58:"%1$s appears to already be configured to work with Matomo.";}s:20:"ProfessionalServices";a:1:{s:29:"WidgetPremiumServicesForPiwik";s:42:"Premium Features &amp; Services for Matomo";}s:9:"Referrers";a:96:{s:11:"Acquisition";s:11:"Acquisition";s:31:"AllReferrersReportDocumentation";s:155:"This report shows all your Referrers in one unified report, listing all Websites, Search keywords and Campaigns used by your visitors to find your website.";s:24:"AllReferrersSubcategory1";s:174:"This section shows you the number of visits that arrive from different channel types and referrers. Click on the plus or minus buttons to view the referrers within each type.";s:24:"AllReferrersSubcategory2";s:144:"You can also analyse the number of actions performed by each of your traffic sources by enabling the table with Visitor engagement metrics view.";s:15:"CampaignContent";s:16:"Campaign content";s:19:"Campai