ew or an event.";s:15:"EtrackerTagHelp";s:0:"";s:15:"EventActionHelp";s:91:"The event\'s action, for example Play, Pause, Duration, Add Playlist, Downloaded, Clicked...";s:17:"EventCategoryHelp";s:57:"The event\'s category, for example Videos, Music, Games...";s:13:"EventNameHelp";s:91:"The event\'s object Name, for example a particular Movie name, or Song name, or File name...";s:10:"EventValue";s:11:"Event Value";s:14:"EventValueHelp";s:88:"The event\'s value, for example "50" as in user has stayed on the website for 50 seconds.";s:19:"EventValueException";s:62:"The event value can only include numeric values and variables.";s:6:"Except";s:6:"Except";s:11:"ExportDraft";s:12:"Export draft";s:7:"ExportX";s:9:"Export %s";s:27:"FacebookPixelTagDescription";s:82:"The Facebook Pixel is a web analytics and advertising service offered by Facebook.";s:20:"FacebookPixelTagHelp";s:138:"This tag lets you track website pageviews in your Facebook Ads account. To obtain the Pixel ID please log in to your Facebook Ads account.";s:20:"FacebookPixelTagName";s:14:"Facebook Pixel";s:6:"Filter";s:6:"Filter";s:9:"FireDelay";s:10:"Fire delay";s:13:"FireDelayHelp";s:239:"Lets you delay the execution of this tag. This can be useful for example if you want to allow some time for a blocking trigger to stop the tag from being executed. The value is expected in milliseconds where 1000ms are equal to one second.";s:9:"FireLimit";s:10:"Fire limit";s:13:"FireLimitHelp";s:652:"The fire limit defines how often this tag will be executed. When set to \'%1$s\', then the tag will be executed each time any of the assigned fire triggers is triggered. When set to \'%2$s\', then the tag will be executed max during a single page view. \'%3$s\' means the tag will not be executed again within the next 24 hours. Opening a new tab or window may cause a new session as well. \'%4$s\' means the tag will be only executed once. Please note for this to work some information will be stored in the browser based on the name of this tag. This means if you choose \'%4$s\' and you change the name of this tag, the tag may be executed again for everyone.";s:15:"FireTriggerHelp";s:311:"This tag will be executed every time any of these triggers are triggered. Not all of them have to be triggered in order for the tag to be executed. Want to execute the trigger only once per page view or session? You can limit how often the tag should be executed in the advanced settings by changing the "%1$s".";s:16:"FireTriggerTitle";s:58:"Execute this tag when any of these triggers are triggered.";s:33:"FirstDirectoryVariableDescription";s:52:"Returns the first directory of the current page URL.";s:26:"FirstDirectoryVariableName";s:19:"First URL Directory";s:23:"FormElementVariableName";s:12:"Form Element";s:30:"FormElementVariableDescription";s:46:"An instance of the element that was submitted.";s:30:"FormClassesVariableDescription";s:53:"The value of all CSS class names of a submitted form.";s:23:"FormClassesVariableName";s:12:"Form Classes";s:34:"FormDestinationVariableDescription";s:53:"The value of the form action URL of a submitted form.";s:27:"FormDestinationVariableName";s:20:"Form Destination URL";s:25:"FormIdVariableDescription";s:50:"The value of the ID attribute of a submitted form.";s:18:"FormIdVariableName";s:7:"Form ID";s:27:"FormNameVariableDescription";s:52:"The value of the name attribute of a submitted form.";s:20:"FormNameVariableName";s:9:"Form Name";s:28:"FormSubmitTriggerDescription";s:37:"Triggered when any form is submitted.";s:21:"FormSubmitTriggerHelp";s:166:"Triggered when any form on the current page is submitted. To listen only to specific forms, please add conditions based on a "form" variable in the advanced settings.";s:21:"FormSubmitTriggerName";s:11:"Form Submit";s:28:"FullscreenTriggerDescription";s:58:"Triggered when the window goes into or leaves full screen.";s:21:"FullscreenTriggerName";s:11:"Full screen";s:14:"GettingStarted";s:15:"Getting Started";s:20:"GettingStartedNotice";s:92:"Want to learn more about what a Tag Manager is? Click on \'Getting Started\' in the left menu.";s:25:"GettingStartedWhatIsIntro";s:262:"Matomo Tag Manager lets you manage and unify all your tracking and marketing tags. Tags are also known as snippets or pixels. Such tags are typically JavaScript code or HTML and let you integrate various features into your site in just a few clicks, for example:";s:31:"GettingStartedAnalyticsTracking";s:23:"Tracking analytics data";s:32:"GettingStartedConversionTracking";s:19:"Conversion tracking";s:31:"GettingStartedNewsletterSignups";s:18:"Newsletter signups";s:25:"GettingStartedExitActions";s:23:"Exit popups and surveys";s:25:"GettingStartedRemarketing";s:11:"Remarketing";s:27:"GettingStartedSocialWidgets";s:14:"Social widgets";s:24:"GettingStartedAffiliates";s:10:"Affiliates";s:17:"GettingStartedAds";s:3:"Ads";s:21:"GettingStartedAndMore";s:8:"and more";s:28:"GettingStartedMainComponents";s:49:"This can be achieved using these main components:";s:26:"GettingStartedTagComponent";s:87:"Tags - A snippet of code (usually JavaScript or HTML) which will be added to your site.";s:30:"GettingStartedTriggerComponent";s:46:"Triggers - Defines when a tag should be fired.";s:31:"GettingStartedVariableComponent";s:74:"Variables - Lets you retrieve data which can be used by tags and triggers.";s:24:"GettingStartedWhyDoINeed";s:36:"Why or when do I need a Tag Manager?";s:32:"GettingStartedWhyMakesLifeEasier";s:389:"A Tag Manager makes your life easier when you want to modify any of these snippets on your website as you will no longer need a developer to make the needed changes for you. Instead of waiting for someone to make these changes and to deploy your website, you can now easily make the needed changes yourself. This lets you not only bring changes to the market faster, but also reduces cost.";s:35:"GettingStartedWhyThirdPartySnippets";s:199:"It also comes in handy if you embed many third-party snippets into your website and want to bring in some order to oversee all the snippets that are embedded and have a convenient way to manage them.";s:36:"GettingStartedWhyAccuracyPerformance";s:131:"The Tag Manager also makes sure all that all snippets are implemented correctly and loaded in the right way for faster performance.";s:20:"GettingStartedHowDoI";s:21:"How do I get started?";s:32:"GettingStartedHowCreateContainer";s:71:"If you haven\'t created a container yet, %1$screate a container now%2$s.";s:25:"GettingStartedHowCopyCode";s:232:"Next you need to copy/paste the code for the container into your website, this is a simple HTML snippet. From this point, this code will load all other snippets and you usually won\'t need to make any changes to your website anymore.";s:35:"GettingStartedHowAddTagsToContainer";s:260:"Now you can add one or multiple tags to your container. If you have embedded a tag manually into your site in the past, you should at the same time also remove all previously added snippets from your website as they will be then loaded through the tag manager.";s:31:"GettingStartedWhatIfUnsupported";s:64:"What if a tag, trigger, or variable I need is not supported yet?";s:24:"GettingStartedCustomTags";s:112:"There are custom tags, triggers, and variables available to let you implement pretty much any use case you need.";s:28:"GettingStartedContributeTags";s:250:"If you use features regularly which are not available yet, or you have a product you want to integrate into the Tag Manager, please check out our %1$sdeveloper documentation%2$s on how to add your own tags, triggers, and variables. It is really easy.";s:6:"GoalId";s:7:"Goal ID";s:10:"GoalIdHelp";s:46:"The ID of the goal you want to track manually.";s:15:"GoalRevenueHelp";s:479:"The estimated revenue value to track when the goal is triggered manually. As this value will be used in a calculation, it must either be a numeric value or it must reference a variable that contains a numeric value. If this field is empty or references a variable that doesn\'t contain a valid numeric value, the value will default to the revenue configured as part of the goal being triggered. A valid numeric value is something like 2430 or 2430.00 (note the absence of commas).";s:38:"GoogleAnalyticsUniversalTagDescription";s:62:"Google Analytics is a web analytics service offered by Google.";s:31:"GoogleAnalyticsUniversalTagHelp";s:143:"This tag lets you track website pageviews into your Google Analytics. To obtain the Property-ID please log in to your Google Analytics account.";s:31:"GoogleAnalyticsUniversalTagName";s:28:"Google Analytics (Universal)";s:20:"HideAdvancedSettings";s:22:"Hide advanced settings";s:31:"HistoryChangeTriggerDescription";s:39:"Triggered when the current URL changes.";s:24:"HistoryChangeTriggerName";s:14:"History Change";s:37:"HistoryHashNewPathVariableDescription";s:0:"";s:30:"HistoryHashNewPathVariableName";s:16:"History New Path";s:39:"HistoryHashNewSearchVariableDescription";s:0:"";s:32:"HistoryHashNewSearchVariableName";s:18:"History New Search";s:36:"HistoryHashNewUrlVariableDescription";s:0:"";s:29:"HistoryHashNewUrlVariableName";s:15:"History New URL";s:33:"HistoryHashNewVariableDescription";s:0:"";s:26:"HistoryHashNewVariableName";s:16:"History New Hash";s:37:"HistoryHashOldPathVariableDescription";s:0:"";s:30:"HistoryHashOldPathVariableName";s:16:"History Old Path";s:39:"HistoryHashOldSearchVariableDescription";s:0:"";s:32:"HistoryHashOldSearchVariableName";s:18:"History Old Search";s:36:"HistoryHashOldUrlVariableDescription";s:0:"";s:29:"HistoryHashOldUrlVariableName";s:15:"History Old URL";s:33:"HistoryHashOldVariableDescription";s:0:"";s:26:"HistoryHashOldVariableName";s:16:"History Old Hash";s:32:"HistorySourceVariableDescription";s:71:"For example "popstate", "historychange", "pushState", or "replaceState"";s:25:"HistorySourceVariableName";s:14:"History Source";s:25:"HoneybadgerTagDescription";s:58:"Exception and Uptime Monitoring for Application Developers";s:18:"HoneybadgerTagHelp";s:70:"This tag adds the official Honeybadger Javascript SDK to your website.";s:6:"Import";s:6:"Import";s:13:"ImportVersion";s:16:"Import a version";s:21:"InitializeTrackerOnly";s:46:"Initialise tracker only. Don\'t track anything.";s:11:"InstallCode";s:12:"Install Code";s:24:"InstallCodeDataLayerNote";s:140:"In addition to the container, one can add a %1$sdatalayer%2$s in order to make data available for the tag manager to collect even more data.";s:33:"InstallCodePublishEnvironmentNote";s:347:"Please note that in order for a container to be functional for a specific environment, you have to publish a version to that environment. You can find below a list of all environments that have a version published currently. When a "%s" is enabled, the preview will be loaded automatically through any of the environments when you access the page.";s:26:"IsoDateVariableDescription";s:80:"The current date and time in ISO format, for example "2018-03-19T14:00:00.587Z".";s:19:"IsoDateVariableName";s:8:"ISO Date";s:15:"InvalidDebugUrl";s:25:"The debug URL is invalid.";s:20:"InvalidDebugUrlError";s:5:"Error";s:33:"JavaScriptErrorTriggerDescription";s:42:"Triggered when a JavaScript error happens.";s:26:"JavaScriptErrorTriggerName";s:16:"JavaScript Error";s:29:"JavaScriptVariableDescription";s:48:"Reads the value of a global JavaScript variable.";s:22:"JavaScriptVariableName";s:19:"JavaScript Variable";s:11:"LastUpdated";s:12:"Last updated";s:12:"LastVersions";s:13:"Last versions";s:9:"LearnMore";s:10:"Learn more";s:23:"LivezillaDynamicTagName";s:27:"Livezilla Chat / Monitoring";s:30:"LivezillaDynamicTagDescription";s:66:"Livezilla lets you monitor and chat with visitors on your website.";s:23:"LivezillaDynamicTagHelp";s:127:"This tag allows you to add the Dynamic Code integration from Livezilla to Chat with you Customers or just Monitor your website.";s:28:"LocalDateVariableDescription";s:61:"The current user\'s local date, for example "Mon Mar 19 2018".";s:21:"LocalDateVariableName";s:10:"Local Date";s:28:"LocalHourVariableDescription";s:60:"The current hour of the local time, for example "8" or "11".";s:21:"LocalHourVariableName";s:10:"Local Hour";s:28:"LocalTimeVariableDescription";s:70:"The current user\'s local time, for example "14:00:00 GMT+1300 (NZDT)".";s:21:"LocalTimeVariableName";s:10:"Local Time";s:11:"LookupTable";s:12:"Lookup Table";s:21:"LookupTableMatchValue";s:10:"this value";s:19:"LookupTableOutValue";s:26:"then convert to this value";s:16:"LookupTableTitle";s:98:"Convert the value of a variable automatically to another value when the value of this variable ...";s:7:"ManageX";s:9:"Manage %s";s:6:"Change";s:6:"Change";s:16:"DetectingChanges";s:20:"Detecting changes...";s:23:"ChangesSinceLastVersion";s:30:"Changes since the last version";s:15:"ManageTagsHelp1";s:54:"How does the "Tag Manager > Manage Tags" page help me?";s:15:"ManageTagsHelp2";s:198:"The Manage Tags page makes managing tags easy by providing an instant overview of the tags in your Matomo Tag Manager. Within the Manage Tags page, you also can edit or delete a tag (under Actions).";s:15:"ManageTagsHelp3";s:105:"Learn more about %1$stags%2$s or %3$sMatomo Tag Manager%4$s, and watch the %5$straining video series%6$s.";s:19:"ManageTriggersHelp1";s:58:"How does the "Tag Manager > Manage Triggers" page help me?";s:19:"ManageTriggersHelp2";s:218:"The Manage Triggers page makes managing triggers easy by providing an instant overview of the triggers in your Matomo Tag Manager. Within the Manage Triggers page, you also can edit or delete a trigger (under Actions).";s:19:"ManageTriggersHelp3";s:109:"Learn more about %1$striggers%2$s or %3$sMatomo Tag Manager%4$s, and watch the %5$straining video series%6$s.";s:20:"ManageVariablesHelp1";s:59:"How does the "Tag Manager > Manage Variables" page help me?";s:20:"ManageVariablesHelp2";s:223:"The Manage Variables page makes managing variables easy by providing an instant overview of the variables in your Matomo Tag Manager. Within the Manage Variables page, you also can edit or delete a variable (under Actions).";s:20:"ManageVariablesHelp3";s:110:"Learn more about %1$svariables%2$s or %3$sMatomo Tag Manager%4$s, and watch the %5$straining video series%6$s.";s:19:"ManageVersionsHelp1";s:58:"How does the "Tag Manager > Manage Versions" page help me?";s:19:"ManageVersionsHelp2";s:250:"The Manage Versions page makes managing versions easy by providing an instant overview of the versions in your Matomo Tag Manager. Within the Manage Versions page, you can also publish, preview/debug, export, edit or delete a version (under Actions).";s:19:"ManageVersionsHelp3";s:109:"Learn more about %1$sversions%2$s or %3$sMatomo Tag Manager%4$s, and watch the %5$straining video series%6$s.";s:60:"MatomoConfigurationMatomoDisableBrowserFeatureDetectionTitle";s:33:"Disable Browser Feature Detection";s:66:"MatomoConfigurationMatomoDisableBrowserFeatureDetectionDescription";s:275:"By default, Matomo accesses some information from the visitor’s browser like the browser resolution. Some privacy regulations may allow access of such information from the visitor’s device only after having a consent. If this applies to you, you can disable this feature.";s:65:"MatomoConfigurationMatomoDisableBrowserFeatureDetectionInLineHelp";s:46:"%1$sTo learn more, check this %2$sFAQ%3$s.%4$s";s:28:"MatomoConfigurationFieldHelp";s:74:"Assign a Matomo configuration in order to track data into a specific site.";s:38:"MatomoConfigurationVariableDescription";s:45:"Defines a configuration for Matomo Analytics.";s:31:"MatomoConfigurationVariableName";s:20:"Matomo Configuration";s:33:"MatomoConfigurationMatomoUrlTitle";s:10:"Matomo URL";s:39:"MatomoConfigurationMatomoUrlDescription";s:145:"The URL of your Matomo instance. It should not include "/index.php" or "piwik.php". The URL of your current Matomo URL instance is preconfigured.";s:36:"MatomoConfigurationMatomoIDSiteTitle";s:13:"Matomo idSite";s:42:"MatomoConfigurationMatomoIDSiteDescription";s:196:"The idSite you want to track data into. The idSite of the current website is preconfigured. You may also find the idSite of any other website under "Administration => Manage Measurables/Websites".";s:40:"MatomoConfigurationMatomoIDSiteException";s:50:"The idSite can only include idSites and variables.";s:48:"MatomoConfigurationMatomoEnableLinkTrackingTitle";s:20:"Enable Link Tracking";s:54:"MatomoConfigurationMatomoEnableLinkTrackingDescription";s:52:"Enables the automatic download and outlink tracking.";s:54:"MatomoConfigurationMatomoEnableCrossDomainLinkingTitle";s:27:"Enable Cross Domain Linking";s:60:"MatomoConfigurationMatomoEnableCrossDomainLinkingDescription";s:80:"Enable this to accurately measure the same visitor across multiple domain names.";s:46:"MatomoConfigurationMatomoEnableDoNotTrackTitle";s:19:"Enable Do Not Track";s:52:"MatomoConfigurationMatomoEnableDoNotTrackDescription";s:110:"Enable this feature to not track users who opt out of tracking using Mozilla\'s (proposed) Do Not Track setting";s:51:"MatomoConfigurationMatomoEnableDoNotTrackInlineHelp";s:244:"%1$sNote: When enabled it sets _paq.push(["setDoNotTrack", true]); which will not send any tracking request when a visitor has DNT enabled unlike the "DNT Matomo Setting" which drops the request on the server when a visitor has DNT enabled.%2$s";s:51:"MatomoConfigurationMatomoEnableJSErrorTrackingTitle";s:32:"Enable JavaScript Error Tracking";s:57:"MatomoConfigurationMatomoEnableJSErrorTrackingDescription";s:63:"Enables the tracking of uncaught JavaScript errors as an event.";s:50:"MatomoConfigurationMatomoEnableHeartBeatTimerTitle";s:22:"Enable HeartBeat Timer";s:56:"MatomoConfigurationMatomoEnableHeartBeatTimerDescription";s:125:"Install a Heart beat timer that will regularly send requests to Matomo in order to better measure the time spent on the page.";s:49:"MatomoConfigurationMatomoEnableFormAnalyticsTitle";s:20:"Enable Form Tracking";s:55:"MatomoConfigurationMatomoEnableFormAnalyticsDescription";s:30:"Enables the tracking of forms.";s:54:"MatomoConfigurationMatomoEnableFormAnalyticsInlineHelp";s:131:"%1$sNote: When disabled it will execute Matomo.FormAnalytics.disableFormAnalytics(); which will disable form tracking requests.%2$s";s:50:"MatomoConfigurationMatomoEnableMediaAnalyticsTitle";s:21:"Enable Media Tracking";s:56:"MatomoConfigurationMatomoEnableMediaAnalyticsDescription";s:38:"Enables the tracking of media players.";s:55:"MatomoConfigurationMatomoEnableMediaAnalyticsInlineHelp";s:134:"%1$sNote: When disabled it will execute Matomo.MediaAnalytics.disableMediaAnalytics(); which will disable media tracking requests.%2$s";s:56:"MatomoConfigurationMatomoTrackAllContentImpressionsTitle";s:29:"Track All Content Impressions";s:62:"MatomoConfigurationMatomoTrackAllContentImpressionsDescription";s:139:"Enables the content tracking feature by scanning the entire DOM for all content blocks and tracks all impressions once the page has loaded.";s:60:"MatomoConfigurationMatomoTrackVisibleContentImpressionsTitle";s:33:"Track Visible Content Impressions";s:66:"MatomoConfigurationMatomoTrackVisibleContentImpressionsDescription";s:196:"Enables the content tracking feature by scanning the entire DOM for all content blocks but only tracks content impressions once the user scrolls to the content and the content is actually visible.";s:44:"MatomoConfigurationMatomoDisableCookiesTitle";s:15:"Disable cookies";s:50:"MatomoConfigurationMatomoDisableCookiesDescription";s:33:"Disables all first party cookies.";s:44:"MatomoConfigurationMatomoRequireConsentTitle";s:24:"Require tracking consent";s:50:"MatomoConfigurationMatomoRequireConsentDescription";s:183:"Track only when user gave tracking consent. In a consent screen you need to call "window._paq=window._paq||[];window._paq.push([\'rememberConsentGiven\']);" when the user gives consent.";s:55:"MatomoConfigurationMatomoCustomCookieTimeOutEnableTitle";s:36:"Enable custom visitor Cookie timeout";s:61:"MatomoConfigurationMatomoCustomCookieTimeOutEnableDescription";s:67:"Allows you to set a custom time in full days for the _pk_id cookie.";s:49:"MatomoConfigurationMatomoCustomCookieTimeOutTitle";s:34:"The pk_id expire time in full days";s:55:"MatomoConfigurationMatomoCustomCookieTimeOutDescription";s:109:"Timeout in full days. By default, the Matomo tracking cookie expires in 13 months (365 + 28 days) = 393 days.";s:50:"MatomoConfigurationMatomoRequireCookieConsentTitle";s:22:"Require cookie consent";s:56:"MatomoConfigurationMatomoRequireCookieConsentDescription";s:249:"Use cookies only if the user gave cookie consent, otherwise track the user without cookies. In a consent screen you need to call "window._paq=window._paq||[];window._paq.push([\'rememberCookieConsentGiven\']);" when the user gives consent for cookies.";s:45:"MatomoConfigurationMatomoSetSecureCookieTitle";s:20:"Enable Secure Cookie";s:51:"MatomoConfigurationMatomoSetSecureCookieDescription";s:194:"Enable the Secure cookie flag on all first party cookies. This should be used when your website is only available under HTTPS so that all tracking cookies are always sent over secure connection.";s:42:"MatomoConfigurationMatomoCookieDomainTitle";s:13:"Cookie Domain";s:47:"MatomoConfigurationMatomoCookieDomainInlineHelp";s:318:"The default is the current document domain. If your website can be visited for example at both www.example.com and example.com, you would use: ".example.com" or "*.example.com". %1$sNote: The variable is only evaluated at the time when tracker is being created, make sure you have the variable defined before that.%2$s";s:40:"MatomoConfigurationMatomoCookiePathTitle";s:11:"Cookie Path";s:46:"MatomoConfigurationMatomoCookiePathDescription";s:296:"When tracking many subdirectories in separate websites, the cookie path prevents the number of cookies to quickly increase and prevent browser from deleting some of the cookies. This ensures optimal data accuracy and improves performance for your users (fewer cookies are sent with each request).";s:44:"MatomoConfigurationMatomoCookieSameSiteTitle";s:16:"Same Site Cookie";s:50:"MatomoConfigurationMatomoCookieSameSiteDescription";s:403:"Set the SameSite attribute for cookies to a custom value. You might want to use this if your site is running in an iframe since then it will only be able to access the cookies if SameSite is set to "None". Choosing "None" will only work on HTTPS and will automatically also set the secure cookie. If your site is available under http and https, using "None" might lead to duplicate or incomplete visits.";s:37:"MatomoConfigurationMatomoDomainsTitle";s:7:"Domains";s:43:"MatomoConfigurationMatomoDomainsDescription";s:216:"Used to detect outlinks. Add hostnames or domains to be treated as local. For wildcard subdomains, you can use: ".example.com" or "*.example.com". You can also specify a path along a domain: "*.example.com/subsite1".";s:41:"MatomoConfigurationMatomoDomainsException";s:26:"Value needs to be an array";s:49:"MatomoConfigurationMatomoAlwaysUseSendBeaconTitle";s:21:"Always use sendBeacon";s:55:"MatomoConfigurationMatomoAlwaysUseSendBeaconDescription";s:169:"Enables sendBeacon usage instead of a regular ajax request. This means when a user clicks for example on an outlink, the navigation to this page will happen much faster.";s:36:"MatomoConfigurationMatomoUserIdTitle";s:7:"User ID";s:42:"MatomoConfigurationMatomoUserIdDescription";s:69:"Sets a User ID to this user (such as an email address or a username).";s:46:"MatomoConfigurationMatomoCustomDimensionsTitle";s:17:"Custom Dimensions";s:52:"MatomoConfigurationMatomoCustomDimensionsDescription";s:49:"Optionally set one or multiple custom dimensions.";s:50:"MatomoConfigurationMatomoCustomDimensionsException";s:26:"Value needs to be an array";s:43:"MatomoConfigurationMatomoBundleTrackerTitle";s:14:"Bundle Tracker";s:49:"MatomoConfigurationMatomoBundleTrackerDescription";s:507:"By bundling the Matomo JavaScript tracker directly into the container it may improve the performance of your website as it reduces the number of needed requests. It is recommended to bundle the Matomo tracker because in most cases the tracker would otherwise be loaded in a separate request on page view anyway. Note: If you use two different Matomo configurations in one container, the setting of the first configuration used in the first Matomo Tag will be applied to all Matomo tags within one container.";s:54:"MatomoConfigurationMatomoRegisterAsDefaultTrackerTitle";s:27:"Register As Default Tracker";s:60:"MatomoConfigurationMatomoRegisterAsDefaultTrackerDescription";s:264:"When enabled, the tracker will be registered as the default one for the website, and will receive all commands that get pushed into the global _paq variable. Useful if you want to use the tracker config from the container with your own _paq.push() JavaScript code.";s:40:"MatomoConfigurationMatomoJsEndpointTitle";s:23:"Tracker Javascript Path";s:46:"MatomoConfigurationMatomoJsEndpointDescription";s:122:"Here you can configure the source path of the Matomo Tracker JavaScript, if you are not using the "Bundle Tracker" option.";s:46:"MatomoConfigurationMatomoTrackingEndpointTitle";s:28:"Tracking Request Target Path";s:52:"MatomoConfigurationMatomoTrackingEndpointDescription";s:61:"Here you can configure the target path for tracking requests.";s:20:"MatomoTagDescription";s:53:"Matomo is the leading open source analytics platform.";s:13:"MatomoTagHelp";s:108:"This tag lets you track pageviews and events into your Matomo. You can customize the tracking to your needs.";s:13:"MatomoTagName";s:16:"Matomo Analytics";s:30:"MetaContentVariableDescription";s:41:"Reads a value from a "meta" HTML element.";s:23:"MetaContentVariableName";s:17:"Page Meta Content";s:19:"NameOfLatestVersion";s:39:"The name of the previous version is %s.";s:5:"Names";s:5:"Names";s:17:"NoContainersFound";s:19:"No container found.";s:31:"NoMatomoConfigFoundForContainer";s:48:"No Matomo configuration found in this container.";s:15:"NoReleasesFound";s:17:"No release found.";s:27:"NoReleasesFoundForContainer";s:45:"No release has been found for this container.";s:11:"NoTagsFound";s:13:"No tag found.";s:15:"NoTriggersFound";s:16:"No trigger found";s:16:"NoVariablesFound";s:18:"No variable found.";s:15:"NoVersionsFound";s:17:"No version found.";s:11:"Once24Hours";s:17:"Once per 24 hours";s:12:"OnceLifetime";s:16:"Once in lifetime";s:8:"OncePage";s:17:"Once per pageview";s:15:"OnlyTriggerWhen";s:17:"Only trigger when";s:25:"OrCreateAndPublishVersion";s:42:"or create version and publish this version";s:27:"PageHashVariableDescription";s:66:"Returns the hash part of the current URL without the leading hash.";s:20:"PageHashVariableName";s:9:"Page Hash";s:31:"PageHostnameVariableDescription";s:40:"Returns the hostname of the current URL.";s:24:"PageHostnameVariableName";s:13:"Page Hostname";s:36:"PageLoadTimeTotalVariableDescription";s:50:"The total amount of time it took to load the page.";s:29:"PageLoadTimeTotalVariableName";s:20:"Page Load Time Total";s:29:"PageOriginVariableDescription";s:50:"Returns a domain of the current URL with protocol.";s:22:"PageOriginVariableName";s:11:"Page Origin";s:27:"PagePathVariableDescription";s:40:"Returns the path of the current page URL";s:20:"PagePathVariableName";s:9:"Page Path";s:33:"PageRenderTimeVariableDescription";s:67:"The time it took to render the page in the browser in milliseconds.";s:26:"PageRenderTimeVariableName";s:16:"Page Render Time";s:28:"PageTitleVariableDescription";s:38:"Returns the title of the current page.";s:21:"PageTitleVariableName";s:10:"Page Title";s:26:"PageUrlVariableDescription";s:30:"Returns the full URL of a page";s:19:"PageUrlVariableName";s:8:"Page URL";s:26:"PageViewTriggerDescription";s:65:"Triggered as soon as the Tag Manager is executed within the page.";s:19:"PageViewTriggerName";s:8:"Pageview";s:24:"PingdomRUMTagDescription";s:103:"Pingdom Real User Monitoring (RUM) lets you collect performance data from actual visitors to your site.";s:17:"PingdomRUMTagHelp";s:79:"This tag allows you to add the Pingdom Real User Monitoring (RUM) to your site.";s:17:"PluginDescription";s:71:"Manage and unify all your tracking and marketing snippets in one place.";s:22:"PreConfiguredInfoTitle";s:196:"Pre-configured variables are variables that are ready-to-use and cannot be created, edited, or configured. They work out of the box and you can use them in tags, triggers, and variables if needed.";s:22:"PreconfiguredVariables";s:24:"Pre-configured variables";s:36:"PreviewDebugEnabledNotificationLine1";s:92:"Preview mode is enabled%1$s. Access your website or enter a URL to debug the container now. ";s:36:"PreviewDebugEnabledNotificationLine2";s:221:"If you want to %1$sshare the preview%2$s with someone else, please append %3$s or %4$s to the URL of your website.%5$sWhile this mode is enabled, the preview container will be automatically updated when you make a change.";s:36:"PreviewDebugEnabledNotificationLine3";s:49:"Debug not working? Please check this %1$sFAQ%2$s.";s:25:"PreviewDebugUrlButtonText";s:5:"Debug";s:30:"PreviewModeVariableDescription";s:85:"Returns either "1" or "0" depending on whether the preview mode is currently enabled.";s:23:"PreviewModeVariableName";s:12:"Preview Mode";s:8:"Priority";s:8:"Priority";s:12:"PriorityHelp";s:125:"The lower the priority is, the earlier this tag may be fired when several tags would be otherwise triggered at the same time.";s:7:"Publish";s:7:"Publish";s:14:"PublishRelease";s:15:"Publish release";s:14:"PublishVersion";s:26:"Publish version "%s" to...";s:42:"PublishVersionToEnvironmentToViewEmbedCode";s:83:"Please publish a version to an environment in order to view the tracking code here.";s:40:"PublishLiveEnvironmentCapabilityRequired";s:114:"Please note that only an "Admin" user, or a user with the "%1$s" capability can publish to the "Live" environment.";s:20:"RaygunTagDescription";s:49:"Error, crash and performance monitoring software.";s:13:"RaygunTagHelp";s:57:"This tag adds the official raygun4js SDK to your website.";s:31:"RandomNumberVariableDescription";s:73:"Returns a random number each time the value of the variable is retrieved.";s:24:"RandomNumberVariableName";s:13:"Random Number";s:30:"ReferrerUrlVariableDescription";s:35:"Gets the value of the Referrer URL.";s:23:"ReferrerUrlVariableName";s:12:"Referrer URL";s:27:"ReferrerVariableDescription";s:37:"Returns the full URL of the referrer.";s:20:"ReferrerVariableName";s:12:"Referrer URL";s:11:"ReleaseInfo";s:25:"Released by %1$s on %2$s.";s:18:"ReleaseVersionInfo";s:16:"Version name %s.";s:8:"Released";s:8:"Released";s:10:"ReleasedBy";s:11:"Released by";s:10:"ReleasedOn";s:11:"Released on";s:16:"ReleasesOverview";s:17:"Releases overview";s:8:"Revision";s:8:"Revision";s:40:"ScreenHeightAvailableVariableDescription";s:73:"The screen height that is available within the browser window (viewport).";s:33:"ScreenHeightAvailableVariableName";s:23:"Screen Height Available";s:31:"ScreenHeightVariableDescription";s:45:"The full screen height of the current device.";s:24:"ScreenHeightVariableName";s:13:"Screen Height";s:39:"ScreenWidthAvailableVariableDescription";s:72:"The screen width that is available within the browser window (viewport).";s:32:"ScreenWidthAvailableVariableName";s:22:"Screen Width Available";s:30:"ScreenWidthVariableDescription";s:44:"The full screen width of the current device.";s:23:"ScreenWidthVariableName";s:12:"Screen Width";s:45:"ScrollHorizontalPercentageVariableDescription";s:88:"How far the user has currently scrolled horizontally, for example "75.59" for "75.59%%".";s:38:"ScrollHorizontalPercentageVariableName";s:28:"Scroll Horizontal Percentage";s:34:"ScrollLeftPixelVariableDescription";s:82:"How far the user has currently scrolled horizontally in pixels, for example "592".";s:27:"ScrollLeftPixelVariableName";s:17:"Scroll Left Pixel";s:29:"ScrollReachTriggerDescription";s:60:"Triggered as soon as the user scrolls to a certain position.";s:22:"ScrollReachTriggerHelp";s:310:"This trigger is triggered when a user either scrolls or resizes the current browser window. The trigger is not triggered when the user scrolls within a certain element. It won\'t trigger every time a certain scroll position has been reached but only the very first time the configured position has been reached.";s:22:"ScrollReachTriggerName";s:12:"Scroll Reach";s:31:"ScrollSourceVariableDescription";s:120:"Whether the scroll position was originated from a user scroll or a browser resize. Value is either "scroll" or "resize".";s:24:"ScrollSourceVariableName";s:13:"Scroll Source";s:33:"ScrollTopPixelVariableDescription";s:80:"How far the user has currently scrolled vertically in pixels, for example "592".";s:26:"ScrollTopPixelVariableName";s:16:"Scroll Top Pixel";s:43:"ScrollVerticalPercentageVariableDescription";s:86:"How far the user has currently scrolled vertically, for example "75.59" for "75.59%%".";s:36:"ScrollVerticalPercentageVariableName";s:26:"Scroll Vertical Percentage";s:25:"SentryRavenTagDescription";s:109:"Sentry.io is an Open-Source error tracking tool that allows you to detect errors that happen on your website.";s:18:"SentryRavenTagHelp";s:133:"This tag adds Raven.js, the official Javascript SDK. Get started by signing up on sentry.io or setting up your own tracking instance.";s:34:"SeoCanonicalUrlVariableDescription";s:40:"Returns the canonical URL if any is set.";s:27:"SeoCanonicalUrlVariableName";s:13:"Canonical URL";s:27:"SeoNumH1VariableDescription";s:102:"The number of H1 elements that are present on the current page. Useful for example for SEO Monitoring.";s:20:"SeoNumH1VariableName";s:21:"Number of H1 Elements";s:27:"SeoNumH2VariableDescription";s:102:"The number of H2 elements that are present on the current page. Useful for example for SEO Monitoring.";s:20:"SeoNumH2VariableName";s:21:"Number of H2 Elements";s:33:"SettingCustomTemplatesDescription";s:658:"This setting defines who can use custom templates or whether they should be completely disabled. Changing this setting can improve the security on your website. When you configure a trigger, tag, or a variable, some of them may allow a Matomo user to enter HTML or JavaScript which will be executed on your website. Entering custom code cannot only break the container in case there is an error, but also allows them to execute any JavaScript code on your website. This can be misused to steal for example sensitive information on your website. If you do not want to allow your team members to enter any JavaScript code, you may want to disable this setting.";s:27:"SettingCustomTemplatesTitle";s:34:"Restrict usage of custom templates";s:29:"SettingEnvironmentDescription";s:208:"Define one or multiple additional environments. Please note that if you remove any environment, generated container files that exist for a specific environment will be removed and will be no longer available.";s:30:"SettingCustomTemplatesDisabled";s:29:"Disabled, nobody can use them";s:27:"SettingCustomTemplatesAdmin";s:49:"Users with at least admin permission can use them";s:31:"SettingCustomTemplatesSuperUser";s:29:"Only Super Users can use them";s:25:"ShareaholicTagDescription";s:50:"Content Marketing Platform & Website Traffic Tools";s:18:"ShareaholicTagHelp";s:80:"This tag lets you add Shareaholic social media buttons and more to your website.";s:20:"ShowAdvancedSettings";s:22:"Show advanced settings";s:9:"StartDate";s:10:"Start date";s:3:"Tag";s:3:"Tag";s:18:"TagDescriptionHelp";s:80:"The tag description lets you provide a brief explanation of what the tag is for.";s:14:"TagEndDateHelp";s:129:"If set, this tag will be fired only up to this end date. The specified date will be assumed to be in %1$syour local timezone%2$s.";s:25:"TagFireTriggerRequirement";s:45:"You need to choose at least one fire trigger.";s:10:"TagManager";s:11:"Tag Manager";s:22:"TagManagerTrackingInfo";s:300:"Don\'t know what a Tag Manager is? Check out our %1$sGetting Started%2$s guide. If you are embedding multiple resources from 3rd party websites into your website, then tracking your website using the %3$sTag Manager%4$s may be a better choice for you compared to using the regular JavaScript tracking.";s:21:"TagsActionDescription";s:32:"Options to edit or delete a tag.";s:26:"TagsDescriptionDescription";s:72:"The optional user-defined label that includes more detail about the tag.";s:26:"TagsLastUpdatedDescription";s:48:"The timestamp of the tag’s last modified date.";s:19:"TagsNameDescription";s:75:"The unique user-defined tag label for identifying and differentiating tags.";s:11:"TagNameHelp";s:200:"The tag name lets you define a unique name for this tag to quickly identify it. Please note that this name will be publicly visible in the source code of the tag when you preview/debug this container.";s:16:"TagStartDateHelp";s:131:"If set, this tag will be fired only after this start date. The specified date will be assumed to be in %1$syour local timezone%2$s.";s:19:"TagsTypeDescription";s:104:"The pre-defined title given to the templated tag by the third-party provider (unless the tag is custom).";s:23:"TagsTriggersDescription";s:42:"The specified event that executes the tag.";s:16:"TagUsageBenefits";s:381:"A tag is a snippet of code which can be executed on your site. Most of the times a tag may be used to either send data to a third-party (for example tracking data) or to embed content from a third-party into your website (for example social widgets or surveys). You can add as many tags as you like and a tag will be executed as soon as the condition of a connected trigger is met.";s:4:"Tags";s:4:"Tags";s:20:"TawkToTagDescription";s:64:"Tawk.to lets you monitor and chat with visitors on your website.";s:13:"TawkToTagHelp";s:68:"This tag allows you to add the Tawk.to contact form to your website.";s:24:"ThemeColorTagDescription";s:35:"Style the UI of supported browsers.";s:17:"ThemeColorTagHelp";s:84:"This tag supports Chrome on Android and other browser that understand \'theme-color\'.";s:17:"ThemeColorTagName";s:11:"Theme Color";s:32:"TimeSinceLoadVariableDescription";s:62:"Calculates the time that has passed since the page was loaded.";s:25:"TimeSinceLoadVariableName";s:20:"Time since page load";s:23:"TimerTriggerDescription";s:62:"Triggered in a specific interval, for example every 3 seconds.";s:16:"TimerTriggerHelp";s:51:"Use this trigger to perform an action periodically.";s:16:"TimerTriggerName";s:5:"Timer";s:12:"TrackingType";s:13:"Tracking Type";s:16:"TrackingTypeHelp";s:62:"Choose which action should be executed when this tag is fired.";s:7:"Trigger";s:7:"Trigger";s:18:"TriggerBeingUsedBy";s:60:"The trigger is currently being used in the following places:";s:27:"TriggerBeingUsedNeedsRemove";s:96:"To delete this trigger, please remove the trigger from the referenced places and then try again.";s:22:"TriggerCannotBeDeleted";s:30:"This trigger cannot be deleted";s:20:"TriggerConditionNode";s:373:"Note: Some variables may not work as you expect. For example using a click variable in combination with a form variable might only work if you have also added a click trigger to your container. This applies typically to variables within the categories Clicks, Forms, History, Errors, Scrolls, and Visibility which should are typically used in their respecting trigger only.";s:21:"TriggerConditionsHelp";s:273:"You can further restrict when this trigger should be triggered by specifying one or multiple conditions. Only when ALL of these conditions are met, the trigger will be actually triggered (not when only one of them is met). Only trigger when all of these conditions are met:";s:22:"TriggerDescriptionHelp";s:88:"The trigger description lets you provide a brief explanation of what the trigger is for.";s:15:"TriggerNameHelp";s:212:"The trigger name lets you define a unique name for this trigger to quickly identify it. Please note that this name will be publicly visible in the source code of the trigger when you preview/debug this container.";s:20:"TriggerUsageBenefits";s:292:"Triggers let you define on which event a certain tag should be fired or blocked. For example when a specific element was clicked, or when a visitor reached a certain scroll position. Additionally, you can specify a filter to further restrict when a certain trigger should be triggered or not.";s:8:"Triggers";s:8:"Triggers";s:23:"TriggersNameDescription";s:83:"The unique user-defined trigger label for identifying and differentiating triggers.";s:30:"TriggersDescriptionDescription";s:76:"The optional user-defined label that includes more detail about the trigger.";s:23:"TriggersTypeDescription";s:46:"The pre-defined classification of the trigger.";s:25:"TriggersFilterDescription";s:64:"The optional condition(s) to restrict when the trigger is fired.";s:30:"TriggersLastUpdatedDescription";s:52:"The timestamp of the trigger’s last modified date.";s:25:"TriggersActionDescription";s:36:"Options to edit or delete a trigger.";s:4:"Type";s:4:"Type";s:5:"Types";s:5:"Types";s:9:"Unlimited";s:9:"Unlimited";s:13:"UpdatePreview";s:14:"Update Preview";s:8:"UpdatedX";s:48:"Fantastic! The %s has been successfully updated.";s:12:"UpdatingData";s:16:"Updating data...";s:31:"UrlParameterVariableDescription";s:43:"Gets the value of a specific URL parameter.";s:24:"UrlParameterVariableName";s:13:"URL Parameter";s:22:"UrlVariableDescription";s:39:"Gets the value of the current page URL.";s:15:"UrlVariableName";s:12:"URL Variable";s:35:"UseCustomTemplateCapabilityRequired";s:112:"This is a Custom Template which can only be created or edited by an "Admin" or a user with the "%1$s" capability";s:28:"UserAgentVariableDescription";s:128:"Gets the value of the user agent which includes the operating system and browser information about the current visitors\' device.";s:21:"UserAgentVariableName";s:10:"User Agent";s:26:"UtcDateVariableDescription";s:69:"The current date in UTC, for example "Mon, 19 Mar 2018 14:00:00 GMT".";s:19:"UtcDateVariableName";s:8:"UTC Date";s:34:"ValidatorErrorNotNumericOrVariable";s:38:"The value is not a number or variable.";s:8:"Variable";s:8:"Variable";s:19:"VariableBeingUsedBy";s:61:"The variable is currently being used in the following places:";s:28:"VariableBeingUsedNeedsRemove";s:98:"To delete this variable, please remove the variable from the referenced places and then try again.";s:23:"VariableCannotBeDeleted";s:31:"This variable cannot be deleted";s:23:"VariableDescriptionHelp";s:90:"The variable description lets you provide a brief explanation of what the variable is for.";s:16:"VariableNameHelp";s:215:"The variable name lets you define a unique name for this variable to quickly identify it. Please note that this name will be publicly visible in the source code of the variable when you preview/debug this container.";s:21:"VariableUsageBenefits";s:225:"Variables let you retrieve data which can be used by tags and triggers. Matomo Tag Manager comes with a set of predefined variables which can be used right away, and some other variables which can be configured to your needs.";s:9:"Variables";s:9:"Variables";s:24:"VariablesNameDescription";s:85:"The unique user-defined variable label for identifying and differentiating variables.";s:31:"VariablesDescriptionDescription";s:77:"The optional user-defined label that includes more detail about the variable.";s:24:"VariablesTypeDescription";s:47:"The pre-defined classification of the variable.";s:31:"VariablesLookupTableDescription";s:69:"A user-defined variable which changes according to some condition(s).";s:31:"VariablesLastUpdatedDescription";s:53:"The timestamp of the variable’s last modified date.";s:26:"VariablesActionDescription";s:37:"Options to edit or delete a variable.";s:7:"Version";s:7:"Version";s:8:"VersionX";s:10:"version %s";s:40:"VersionAlreadyPublishedToAllEnvironments";s:59:"This version cannot be published to any further environment";s:18:"VersionDescription";s:19:"Version description";s:22:"VersionDescriptionHelp";s:295:"Optionally, you can describe this new version in more detail. We recommend to mention what you changed in this version. For example whether you fixed a particular issue or added a new tag. This helps you to better understand each version for example if you have to rollback to a certain version.";s:22:"VersionEnvironmentHelp";s:445:"In order to embed the current version into your site you need to publish it to an environment, typically the "Live" environment. If you have a specific review process, or testing environments you may want to first publish a version to a "staging" or "test" environment before deploying it on to your live production system to make sure everything works as you expect it to. You can also later at any time publish this version to any environment.";s:25:"VersionImportContentTitle";s:58:"Paste the JSON formatted data that you exported previously";s:17:"VersionImportInfo";s:241:"When you import a container version, the current working draft will be overwritten with this imported version. To export a container version, click on the export next to a version or export the current version draft in the "Versions" screen.";s:29:"VersionImportOverwriteContent";s:41:"Overwrite current draft with this version";s:20:"VersionImportSuccess";s:29:"Version successfully imported";s:11:"VersionName";s:12:"Version name";s:15:"VersionNameHelp";s:499:"Give this version a name that lets you easily identify this particular version. You can use any naming scheme you want. We recommend using a scheme like "1.0" where you increase the last number when you make small changes to it such as fixing a configuration, and the first number when you add for example a new tag. This way you can easily keep track of all your versions. Please note that this name will be also available as a variable and therefore publicly visible in the source code of the tag.";s:21:"VersionPublishSuccess";s:43:"The version has been successfully published";s:15:"VersionRevision";s:16:"Version revision";s:20:"VersionUsageBenefits";s:569:"Versions let you save a copy of the current configuration of a container so you can go back to a previous version of a container if you need to. This makes it easier to recover from mistakes, and lets you easily find all previously deployed tags, triggers, and variables. Once you are happy with your current configuration, you can publish it to a specific environment. For example, you may want to deploy your tag first to a "test" or "staging" environment to make sure the current configuration works before making it available to everyone using the live environment.";s:8:"Versions";s:8:"Versions";s:27:"VersionsRevisionDescription";s:51:"The number of times a new version has been created.";s:23:"VersionsNameDescription";s:75:"The unique user-defined label for identifying and differentiating versions.";s:30:"VersionsDescriptionDescription";s:76:"The optional user-defined label that includes more detail about the version.";s:31:"VersionsEnvironmentsDescription";s:86:"The testing environment the version will be published in (e.g., Dev, Staging or Live).";s:26:"VersionsCreatedDescription";s:35:"The date the version was developed.";s:25:"VersionsActionDescription";s:69:"Options to publish, preview/debug, export, edit, or delete a version.";s:22:"ViewContainerDashboard";s:24:"View Container Dashboard";s:5:"ViewX";s:7:"View %s";s:40:"VisibleElementClassesVariableDescription";s:111:"The value of all CSS class names of an element that was matched when the visible element trigger was triggered.";s:33:"VisibleElementClassesVariableName";s:23:"Visible Element Classes";s:35:"VisibleElementIdVariableDescription";s:108:"The value of the ID attribute of an element that was matched when the visible element trigger was triggered.";s:28:"VisibleElementIdVariableName";s:18:"Visible Element ID";s:41:"VisibleElementNodeNameVariableDescription";s:116:"The value of element name that was matched when the visible element trigger was triggered. For example "P" or "DIV".";s:34:"VisibleElementNodeNameVariableName";s:25:"Visible Element Node Name";s:37:"VisibleElementTextVariableDescription";s:108:"The value of the text content of an element that was matched when the visible element trigger was triggered.";s:30:"VisibleElementTextVariableName";s:20:"Visible Element Text";s:36:"VisibleElementUrlVariableDescription";s:111:"The value of the link URL (href) of an element that was matched when the visible element trigger was triggered.";s:29:"VisibleElementUrlVariableName";s:31:"Visible Element Destination URL";s:36:"VisualWebsiteOptimizerTagDescription";s:91:"Visual Website Optimizer is an all-in-one A/B testing and Conversion Optimization Platform.";s:29:"VisualWebsiteOptimizerTagHelp";s:62:"This tag adds the asynchronous VWO Smart Code to your website.";s:29:"VisualWebsiteOptimizerTagName";s:24:"Visual Website Optimizer";s:35:"WantToDeployThisChangeCreateVersion";s:69:"Do you want to deploy this change? %1$sPublish a new version now%2$s.";s:26:"WeekdayVariableDescription";s:68:"Returns the local day of the week eg monday, tuesday, wednesday, ...";s:19:"WeekdayVariableName";s:7:"Weekday";s:29:"WindowLeaveTriggerDescription";s:98:"Triggered when the user is about to leave the current page by moving the mouse outside the window.";s:22:"WindowLeaveTriggerHelp";s:449:"This trigger is triggered when the user is possibly about to leave the website and moves their mouse outside of the current web page, for example towards the browser URL address line or any other buttons. This can be useful to keep your visitor engaged and not lose the visitor, for example by showing an exit popup. You may be also interested in the "Window Unload" trigger which is triggered as soon as the user has actually left the current page.";s:22:"WindowLeaveTriggerName";s:12:"Window Leave";s:30:"WindowLoadedTriggerDescription";s:65:"Triggered when the page is fully loaded including all images etc.";s:23:"WindowLoadedTriggerHelp";s:252:"This stage of loading a web page, is when the page is fully loaded according to the browser. In most cases this means that also all images are loaded, and all styles are applied etc. This trigger is always triggered at some point after the "DOM Ready".";s:23:"WindowLoadedTriggerName";s:13:"Window Loaded";s:30:"WindowUnloadTriggerDescription";s:98:"Triggered just before the browser window is closed or when the user navigates to a different page.";s:23:"WindowUnloadTriggerHelp";s:282:"This trigger identifies the event when a user is actually closing the current page compared to the "Window Leave" trigger which triggers when the user is about to leave your page. Either by navigating to another page within the current browser tab, or by completely closing the tab.";s:23:"WindowUnloadTriggerName";s:13:"Window Unload";s:25:"ZendeskChatTagDescription";s:63:"Reach your customers, instantly via web, mobile, and messaging.";s:18:"ZendeskChatTagHelp";s:65:"This tag allows you to add the Zendesk Chat form to your website.";s:18:"ZendeskChatTagName";s:29:"Zendesk Chat (formerly Zopim)";s:46:"SettingElementVisibilityObserveDomChangesTitle";s:19:"Observe DOM Changes";s:52:"SettingElementVisibilityObserveDomChangesDescription";s:128:"Enable if you want to track dynamic DOM elements. %1$sNote: This might slow down the website if there are lot of DOM changes%2$s";s:35:"EntityRecursionExceptionForVariable";s:124:"It seems an entity references itself or a recursion is caused in some other way. It may be related due to this entry: "%1$s"";s:47:"AllDownloadsClickTriggerDownloadExtensionsTitle";s:19:"Download Extensions";s:53:"AllDownloadsClickTriggerDownloadExtensionsDescription";s:79:"Comma separated list of file extensions which will be considered as a download.";s:38:"CustomEventTriggerEventNameDescription";s:162:"The name of the event that is pushed to the Data-Layer. For example you can push an event by adding this to your website: _mtm.push({"event": "my-custom-event"});";s:44:"ElementVisibilityTriggerSelectionMethodTitle";s:16:"Selection Method";s:50:"ElementVisibilityTriggerSelectionMethodDescription";s:66:"Select the way you want to identify an element you want to select.";s:40:"ElementVisibilityTriggerCssSelectorTitle";s:12:"CSS Selector";s:46:"ElementVisibilityTriggerCssSelectorDescription";s:253:"A CSS selector allows you to select an element by id, className, element names, etc. If multiple elements match this selector, the first matching element will be used to get the value from. Examples for valid selectors are ".classname", "#id" or "li a".";s:38:"ElementVisibilityTriggerElementIDTitle";s:10:"Element ID";s:44:"ElementVisibilityTriggerElementIDDescription";s:136:"The id attribute specifies a unique id for an HTML element. Insert here the value of an ID attribute of any element within your website.";s:44:"ElementVisibilityTriggerFireTriggerWhenTitle";s:17:"Fire this trigger";s:46:"ElementVisibilityTriggerMinPercentVisibleTitle";s:23:"Minimum Percent Visible";s:35:"FullscreenTriggerTriggerActionTitle";s:32:"Fire this trigger when action is";s:34:"FullscreenTriggerTriggerLimitTitle";s:13:"Trigger limit";s:40:"FullscreenTriggerTriggerLimitDescription";s:50:"Enter "0" to trigger it each time the event occurs";s:33:"ScrollReachTriggerScrollTypeTitle";s:17:"Scroll Match Type";s:29:"ScrollReachTriggerPixelsTitle";s:6:"Pixels";s:35:"ScrollReachTriggerPixelsDescription";s:106:"The amount in pixels that needs to be visible of this element depending on the selected scroll match type.";s:33:"ScrollReachTriggerPercentageTitle";s:10:"Percentage";s:39:"ScrollReachTriggerPercentageDescription";s:160:"You can specify any number between 1 and 100. If you specify 50, then it means the element needs to be at least 50%% visible depending on the scroll match type.";s:32:"TimerTriggerTriggerIntervalTitle";s:16:"Trigger interval";s:32:"TimerTriggerEventNameDescription";s:1