r authentication";s:10:"TwoFAShort";s:3:"2FA";s:28:"TwoFactorAuthenticationIntro";s:201:"%1$sTwo-factor authentication%2$s increases account security by also asking you for a code generated on a mobile device, or one of the remaining recovery codes (in addition to your password) to log in.";s:32:"TwoFactorAuthenticationIsEnabled";s:29:"Two-factor authentication on.";s:33:"TwoFactorAuthenticationIsDisabled";s:30:"Two-factor authentication off.";s:31:"TwoFactorAuthenticationRequired";s:75:"Two-factor authentication is required for everyone, you cannot turn it off.";s:24:"ConfigureDifferentDevice";s:19:"Set up a new device";s:28:"SetUpTwoFactorAuthentication";s:38:"Set up two-factor authentication (2FA)";s:38:"RequiredToSetUpTwoFactorAuthentication";s:60:"You must set up two-factor authentication before logging in.";s:18:"AuthenticationCode";s:19:"Authentication code";s:6:"Verify";s:6:"Verify";s:5:"StepX";s:7:"Step %s";s:18:"MissingAuthCodeAPI";s:48:"Please specify a two-factor authentication code.";s:15:"InvalidAuthCode";s:41:"Incorrect two-factor authentication code.";s:32:"RequiredAuthCodeNotConfiguredAPI";s:66:"You must set up two-factor authentication. Please log in to do so.";s:25:"VerifyIdentifyExplanation";s:108:"Verify yourself by opening the two-factor authentication app on your device to get your authentication code.";s:24:"DontHaveYourMobileDevice";s:30:"Don\'t have your mobile device?";s:24:"EnterRecoveryCodeInstead";s:32:"Enter one of your recovery codes";s:35:"AskSuperUserResetAuthenticationCode";s:49:"Ask a superuser to reset your authentication code";s:21:"SetupIntroFollowSteps";s:62:"Please follow these steps to set up two-factor authentication:";s:18:"SetupFinishedTitle";s:32:"Your account is now more secure.";s:21:"SetupFinishedSubtitle";s:179:"You have now set up two-factor authentication. From now on you need to enter an authentication code to log in. Make sure you have your mobile device or your backup codes with you.";s:31:"WarningChangingConfig